--  DDL for Trigger PR_ENCOUNTER_REVERT_CHKOUT_TRG
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IBAEHIS"."PR_ENCOUNTER_REVERT_CHKOUT_TRG" AFTER UPDATE ON PR_ENCOUNTER

REFERENCING NEW AS NEW OLD AS OLD FOR EACH ROW

   WHEN (NEW.PATIENT_CLASS IN ('OP','EM') AND OLD.VISIT_STATUS = '07' AND NEW.CANCEL_DISCH_DATE IS NOT NULL) BEGIN

		INSERT INTO OP_CANCELLED_CHECKOUT

		(FACILITY_ID, ENCOUNTER_ID, SRL_NO, PATIENT_CLASS, QUEUE_DATE,

		PATIENT_ID, LOCN_TYPE, LOCN_CODE, SPECIALITY_CODE,

		PRACTITIONER_ID, DISCHARGE_DATE_TIME, DISASTER_YN, TRAUMA_YN, DISPOSITION_TYPE,

		CANCEL_REASON_CODE, CANCELLED_BY_ID, CANCELLED_DATE) VALUES

		(:OLD.FACILITY_ID, :OLD.ENCOUNTER_ID, OP_CANCELLED_CHECKOUT_SEQ.NEXTVAL, :OLD.PATIENT_CLASS,	:OLD.VISIT_ADM_DATE_TIME,

		:OLD.PATIENT_ID, :OLD.ASSIGN_CARE_LOCN_TYPE, :OLD.ASSIGN_CARE_LOCN_CODE, :OLD.SPECIALTY_CODE,

		:OLD.ATTEND_PRACTITIONER_ID, :OLD.DISCHARGE_DATE_TIME, :OLD.DISASTER_YN, :OLD.TRAUMA_YN, :OLD.DISPOSITION_TYPE,

		:NEW.CANCEL_CHECKOUT_REASON_CODE, :NEW.CANCEL_CHECKOUT_BY_ID,:NEW.CANCEL_DISCH_DATE);



EXCEPTION WHEN OTHERS THEN

	DBMS_OUTPUT.PUT_LINE(SQLERRM);

END PR_ENCOUNTER_REVERT_CHKOUT_TRG;




/
ALTER TRIGGER "IBAEHIS"."PR_ENCOUNTER_REVERT_CHKOUT_TRG" ENABLE;
--------------------------------------------------------
--  DDL for Trigger CR_PR_ENCNTR_TRG_AU01
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IBAEHIS"."CR_PR_ENCNTR_TRG_AU01" 

AFTER UPDATE OF VISIT_STATUS,ADT_STATUS,ATTEND_PRACTITIONER_ID ON PR_ENCOUNTER

FOR EACH ROW

DECLARE

l_module_id   VARCHAR2(2) := NULL;

l_event_type  VARCHAR2(4) := NULL;

l_event_date  DATE;

BEGIN

       IF :new.patient_class IN ('OP','EM') THEN -- (OP)

          IF :new.visit_status = '99' THEN  -- OP(CANCEL)

	        l_module_id  := 'OP';

		l_event_type := 'VCAN';

		l_event_date := :new.visit_status_set_on_date;

          ELSIF :new.visit_status in ('07','08','09') THEN -- (Non MD,MD,AutoComplete)

	        l_module_id  := 'OP';

		l_event_type := 'VOUT';

		l_event_date := :new.visit_status_set_on_date;

	  END IF;

       ELSE   -- IP

          IF :new.adt_status = '09' THEN  -- IP(CANCEL)

	        l_module_id  := 'IP';

		l_event_type := 'ACAN';

		l_event_date := :new.adt_status_set_on_date;

	  ELSIF :new.adt_status = '08' THEN  -- IP(DISCHARGE)

	        l_module_id  := 'IP';

		l_event_type := 'DISC';

		l_event_date := :new.discharge_date_time;

	  END IF;

       END IF;

    IF CR_GET_EVENT_TYPE_APPL(l_module_id,l_event_type) THEN

            INSERT INTO  CR_ENCOUNTER_SUMMARY_CTL(

		 FACILITY_ID,ACCESSION_NUM,EVENT_DATE,EVENT_TYPE,ACTION_TYPE,

        	 CONTR_SYS_ID,PATIENT_ID,PATIENT_CLASS,ENCOUNTER_ID,LAST_PROC_DATE,

	         EPISODE_ID,VISIT_ID,

     	         ADDED_BY_ID,ADDED_DATE,MODIFIED_BY_ID,MODIFIED_DATE,STATUS)

	    VALUES(

                :NEW.FACILITY_ID,:NEW.ENCOUNTER_ID,l_event_date,l_event_type,

		'U', l_module_id,:NEW.PATIENT_ID,:NEW.PATIENT_CLASS,:NEW.ENCOUNTER_ID,NULL,

		:NEW.EPISODE_ID,:NEW.OP_EPISODE_VISIT_NUM,

                :NEW.ADDED_BY_ID,:NEW.ADDED_DATE,:NEW.MODIFIED_BY_ID,:NEW.MODIFIED_DATE,NULL

		);

    END IF;

    IF NVL(:NEW.ATTEND_PRACTITIONER_ID,'X') <> NVL(:OLD.ATTEND_PRACTITIONER_ID,'X') AND

       CR_GET_EVENT_TYPE_APPL('OP','VIST') AND

       :NEW.PATIENT_CLASS IN ('OP','EM')   THEN

            INSERT INTO  CR_ENCOUNTER_SUMMARY_CTL(

		 FACILITY_ID,ACCESSION_NUM,EVENT_DATE,EVENT_TYPE,ACTION_TYPE,

        	 CONTR_SYS_ID,PATIENT_ID,PATIENT_CLASS,ENCOUNTER_ID,LAST_PROC_DATE,

	         EPISODE_ID,VISIT_ID,

     	         ADDED_BY_ID,ADDED_DATE,MODIFIED_BY_ID,MODIFIED_DATE,STATUS)

	    VALUES(

                :NEW.FACILITY_ID,:NEW.ENCOUNTER_ID,SYSDATE,'VIST',

		'U', 'OP',:NEW.PATIENT_ID,:NEW.PATIENT_CLASS,:NEW.ENCOUNTER_ID,NULL,

		:NEW.EPISODE_ID,:NEW.OP_EPISODE_VISIT_NUM,

                :NEW.ADDED_BY_ID,:NEW.ADDED_DATE,:NEW.MODIFIED_BY_ID,:NEW.MODIFIED_DATE,NULL

		);

    END IF;

EXCEPTION WHEN OTHERS THEN NULL;

END CR_PR_ENCNTR_TRG_AU01;




/
ALTER TRIGGER "IBAEHIS"."CR_PR_ENCNTR_TRG_AU01" ENABLE;
