                      :NEW.modified_at_ws_no, :NEW.modified_facility_id,
                      :NEW.vehicle_involved1_code,
                      :NEW.vehicle_involved2_code, :NEW.pat_position_code,
                      :NEW.PROTECTIVE_DEVICE_CODE
                     );
      END IF;
   END IF;

   ip_audit_function.assign_value ('N');
END;


