--  DDL for Trigger CA_PR_ENCNTR_TRG_AI01
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IBAEHIS"."CA_PR_ENCNTR_TRG_AI01" 
AFTER INSERT ON PR_ENCOUNTER
FOR EACH ROW
DECLARE
l_establish_reln_req_yn VARCHAR2(1 CHAR);
l_pract_reln_id  CA_PRACT_RELN.PRACT_RELN_ID%TYPE :=null;
l_direct_yn  CA_PRACT_RELN.DIRECT_YN%TYPE:='N';
l_end_date_time         DATE;
l_relation_cateogry     VARCHAR2(2 CHAR);
BEGIN
  IF CA_GET_RELN_EXISTS= 'Y' THEN
    IF :new.attend_practitioner_id IS NOT  NULL THEN
       IF :new.patient_class IN ('OP','EM','DC') THEN  -- OP
  l_pract_reln_id:=CA_GET_PRACT_RELATIONSHIP(:new.SPECIALTY_CODE,:new.patient_class);
       ELSE -- IP
  l_pract_reln_id:=CA_GET_PRACT_RELATIONSHIP(:new.SPECIALTY_CODE,'IE');
       END IF;
-- Nanda
       IF l_pract_reln_id IS NOT NULL THEN
      SELECT a.direct_yn, :new.visit_adm_date_time+ CASE WHEN a.expiry_rule in ('DAE','DAA') THEN a.expiry_period WHEN a.expiry_rule in ('HAE','HAA') THEN a.expiry_period/24 ELSE NULL END
      INTO l_direct_yn,l_end_date_time
      FROM ca_pract_reln a
      WHERE pract_reln_id=l_pract_reln_id;
      INSERT INTO CA_ENCNTR_PRACT_RELN(facility_id, encounter_id, pract_reln_id, practitioner_id,
                                     patient_id, patient_class, begin_date_time, end_date_time, direct_yn,status,
         added_by_id, added_date, added_at_ws_no, added_facility_id,
         modified_by_id, modified_date, modified_at_ws_no, modified_facility_id)
  VALUES(:new.facility_id,:new.encounter_id,l_pract_reln_id,:new.attend_practitioner_id,
  :new.patient_id,:new.patient_class,:new.visit_adm_date_time,l_end_date_time,l_direct_yn,'01',
  :new.added_by_id,:new.added_date,:new.added_at_ws_no,:new.added_facility_id,
  :new.modified_by_id,:new.modified_date, :new.modified_at_ws_no, :new.modified_facility_id);
 END IF;
    END IF;
    IF (:new.ADMIT_PRACTITIONER_ID is not null) and nvl(:new.attend_practitioner_id,'*ALL')!=:new.ADMIT_PRACTITIONER_ID THEN
    BEGIN
	  IF :new.patient_class IN ('DC') THEN  --DC
		 l_pract_reln_id:=CA_GET_PRACT_RELATIONSHIP(:new.SPECIALTY_CODE,:new.patient_class);
	  ELSE
	        l_pract_reln_id:=CA_GET_PRACT_RELATIONSHIP(:new.SPECIALTY_CODE,'IA');
	  END IF;
 IF l_pract_reln_id IS NOT NULL THEN
      l_direct_yn:='N';
      l_end_date_time:=null;
      SELECT direct_yn,:new.visit_adm_date_time+ CASE WHEN a.expiry_rule in ('DAE','DAA') THEN a.expiry_period WHEN a.expiry_rule in ('HAE','HAA')
                  THEN a.expiry_period/24 ELSE NULL END expiry_period
           INTO l_direct_yn,l_end_date_time
                    FROM ca_pract_reln a
             WHERE pract_reln_id=l_pract_reln_id;
                     INSERT INTO CA_ENCNTR_PRACT_RELN(facility_id, encounter_id, pract_reln_id, practitioner_id,
                                     patient_id, patient_class, begin_date_time, end_date_time, direct_yn,status,
         added_by_id, added_date, added_at_ws_no, added_facility_id,
         modified_by_id, modified_date, modified_at_ws_no, modified_facility_id)
       VALUES(:new.facility_id,:new.encounter_id,l_pract_reln_id,:new.ADMIT_PRACTITIONER_ID,
       :new.patient_id,:new.patient_class,:new.visit_adm_date_time,l_end_date_time,l_direct_yn,'01',
        :new.added_by_id,:new.added_date,:new.added_at_ws_no,:new.added_facility_id,
       :new.modified_by_id,:new.modified_date, :new.modified_at_ws_no, :new.modified_facility_id);
 END IF;
 EXCEPTION
          WHEN OTHERS  THEN  NULL;
     END;
     END IF;
 END IF;
 EXCEPTION WHEN OTHERS THEN NULL;
END;


