--------------------------------------------------------
--  DDL for Trigger XH_AFINUP_ENCOUNTER_PX1_OUT
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IBAEHIS"."XH_AFINUP_ENCOUNTER_PX1_OUT" 
   AFTER INSERT OR UPDATE
   ON PR_ENCOUNTER    REFERENCING NEW AS NEW OLD AS OLD
   FOR EACH ROW
   WHEN (
NEW.assign_bed_num IS NOT NULL AND OLD.assign_bed_num IS NULL
      ) DECLARE
   v_app_err_msg           VARCHAR2 (4000);
   v_ora_err_msg           VARCHAR2 (4000);
   v_app_err_key           VARCHAR2 (4000);
   --v_proc           VARCHAR2 (4000);
   v_local_db_facility     VARCHAR2 (2);
   v_proc                  VARCHAR2 (30)   := 'XH_AFINUP_ENCOUNTER_PX1_OUT';
   l_interface_yn          VARCHAR2 (1);
   l_filter_yn             VARCHAR2 (1);
   l_fac_int_yn            VARCHAR2 (1);
   l_message_type          VARCHAR2 (10);
   l_event_interfaced_yn   VARCHAR2 (1);
   l_message_id            VARCHAR2 (20);
   l_error_text            VARCHAR2 (4000);
   l_action_type           VARCHAR2 (10);
   l_lang_id               VARCHAR2 (2);
   l_optmsg                CLOB;
   l_ext_num               VARCHAR2 (10);
BEGIN
   xhtracing.g_prog_id := v_proc;
   xhtracing.g_flag := xhtracing.enable_or_disable_tracing;
      xhtracing.traces (v_proc, 'Inside Trigger', 'T');
      xhtracing.traces (v_proc,'Calling xhbase.get_interface_parameters Procedure','T');
   xhbase.get_interface_parameters (l_interface_yn, l_filter_yn);
      xhtracing.traces(v_proc,'Return values from xhbase.get_interface_parameters Procedure --> l_interface_yn - ' || l_interface_yn || ', l_filter_yn - '|| l_filter_yn,'T');

   BEGIN
           xhtracing.traces(v_proc, 'Checking Facility Validity for the facility - '||:NEW.facility_id,'T');

      SELECT 'Y'
        INTO v_local_db_facility
        FROM sm_facility_param
       WHERE facility_id = :NEW.facility_id;

           xhtracing.traces(v_proc, 'v_local_db_facility = '||v_local_db_facility,'T');
      v_local_db_facility := 'Y';
   EXCEPTION
      WHEN NO_DATA_FOUND
      THEN
         v_local_db_facility := 'N';
            xhtracing.traces (v_proc, 'No data Found for the facility ID', 'T');
      WHEN TOO_MANY_ROWS
      THEN
         v_local_db_facility := 'Y';
            xhtracing.traces (v_proc, 'Too Many rows for the facility ID', 'T');
   END;

   IF v_local_db_facility = 'Y'
   THEN
      xhbase.get_facility_parameters (:NEW.facility_id, l_fac_int_yn);
          xhtracing.traces (v_proc, 'l_interface_yn = ' || l_interface_yn, 'T');
          xhtracing.traces (v_proc, 'l_filter_yn = ' || l_filter_yn, 'T');
          xhtracing.traces (v_proc, 'l_fac_int_yn = ' || l_fac_int_yn, 'T');

      IF l_interface_yn = 'Y' AND l_fac_int_yn = 'Y'
      THEN
         xhbase.get_event_message_details ('PX1',l_message_type,l_event_interfaced_yn);
            xhtracing.traces (v_proc,'l_event_interfaced_yn = ' || l_event_interfaced_yn,'T');

         IF l_event_interfaced_yn = 'Y'
         THEN
            SELECT xh_hl7_message_id_seq.NEXTVAL
              INTO l_message_id
              FROM DUAL;

                xhtracing.traces (v_proc, 'l_message_id = ' || l_message_id, 'T');

            IF INSERTING
            THEN
               l_action_type := 'I';
            ELSIF UPDATING
            THEN
               l_action_type := 'U';
            ELSIF DELETING
            THEN
               l_action_type := 'D';
            END IF;

                xhtracing.traces (v_proc, 'l_action_type = ' || l_action_type,'T');

            BEGIN

                xhtracing.traces(v_proc, 'Checking room no for particular patient - '||:NEW.facility_id,'T');

               SELECT 'X'
                 INTO l_ext_num
                 FROM am_facility_room
                WHERE operating_facility_id = :NEW.facility_id
                  AND room_num = :NEW.assign_room_num
                  AND room_type = 'P';
                  --AND ext_num IS NOT NULL;--Commented by Anil on 12/10/09.

               xhtracing.traces (v_proc, 'l_ext_num = ' || l_ext_num, 'T');
            EXCEPTION
               WHEN NO_DATA_FOUND
               THEN
                  l_ext_num := NULL;
                  xhtracing.traces (v_proc,'No data Found for the room no','T');
               WHEN TOO_MANY_ROWS
               THEN
                  l_ext_num := NULL;
                  xhtracing.traces (v_proc,'Too Many rows for the room no','T');
               WHEN OTHERS
               THEN
                  l_ext_num := NULL;
                  xhtracing.traces (v_proc,'Other Exception - '||SUBSTR(SQLERRM,1,3000),'T');
            END;

            --Added by Anil on 12/10/09. If room not PABX enabled then, event should not be generated.
            --As per Chowdary/Krishnan's mail on 09/10/09
            IF l_ext_num = 'X' THEN
                BEGIN
                      xhtracing.traces(v_proc, 'Checking language for particular patient - ','T');
                   SELECT primary_language_id
                     INTO l_lang_id
                     FROM mp_patient
                    WHERE patient_id = :NEW.patient_id;

                      xhtracing.traces (v_proc, 'l_lang_id = ' || l_lang_id, 'T');

                EXCEPTION
                   WHEN NO_DATA_FOUND
                   THEN
                      l_lang_id := NULL;

                        xhtracing.traces(v_proc, 'No data Found for the lang ID','T');

                   WHEN TOO_MANY_ROWS
                   THEN
                      l_lang_id := NULL;

                        xhtracing.traces(v_proc, 'Too Many rows for the lang ID','T');

                END;

                --Message Building format = GI|RN2781|G#49053456|DA060515|TI111740|GN100000000001|GLE|

                l_optmsg :=
                      'GI'
                   --|| '|RN'|| l_ext_num --Commented by anil on 12/10/09
                   || '|RN'|| :NEW.assign_room_num
                   || '|G#'|| :NEW.patient_id
                   || '|DA'|| TO_CHAR (:NEW.visit_adm_date_time, 'YYMMDD')
                   || '|TI'|| TO_CHAR (:NEW.visit_adm_date_time, 'HH24MISS')
                   || '|GN'|| :NEW.encounter_id
                   || '|GL'|| l_lang_id
                   || '|';

                     xhtracing.traces (v_proc, 'FINAL MESSAGE IS = ' || l_optmsg, 'T');
                     xhtracing.traces (v_proc, 'BEFORE INSERT', 'T');

                INSERT INTO xh_event
                            (application_id, message_id, facility_id,
                             message_date, event_type, patient_id,
                             merged_patient_id, episode_type, episode_id,
                             visit_id,
                             accession_num,
                             action_type, last_proc_date, event_status,
                             not_req_reason, ext_accession_num, added_by_id,
                             added_date, modified_by_id, modified_date,
                             added_at_ws_no,
                             added_facility_id,
                             modified_at_ws_no,
                             modified_facility_id, protocol_link_id, sys_def_message_text
                            )
                     VALUES ('EPABX', xh_hl7_message_id_seq.NEXTVAL, :NEW.facility_id,
                             :NEW.modified_date, 'PX1', :NEW.patient_id,
                             ' ', ' ', NULL,
                             NULL,
                                :NEW.facility_id
                             || '$!^'
                             || :NEW.encounter_id
                             || '$!^'
                             || :NEW.assign_room_num
                             || '$!^'
                             || 'GI'
				     || '$!^'
				     || '$!^',--Added By Anil on 06/11/09. For identifying Transfer records.(Should be there at :4 position only. :5 & :6 to be left blank)
                             l_action_type, NULL, NULL,
                             '', '', 'interface ws',
                             :NEW.modified_date, 'interface ws', :NEW.modified_date,
                             NVL (SYS_CONTEXT ('USERENV', 'IP_ADDRESS'),
                                  'DEFAULT'),
                             :NEW.facility_id,
                             NVL (SYS_CONTEXT ('USERENV', 'IP_ADDRESS'),
                                  'DEFAULT'),
                             :NEW.facility_id, 'PABXG', l_optmsg
                            );

                   xhtracing.traces (v_proc, 'AFTER INSERT', 'T');
                   xhtracing.traces (v_proc, 'Insertion Over', 'T');
            ELSE
                   xhtracing.traces (v_proc, 'Not a PABX Room', 'T');
            END IF;

         END IF;
      END IF;
   END IF;

    xhtracing.traces (v_proc, 'Trigger Execution Over', 'T');
EXCEPTION
   WHEN NO_DATA_FOUND
   THEN
      v_ora_err_msg := SQLCODE || ' ' || SUBSTR (SQLERRM, 1, 3900);
      v_app_err_key := :NEW.facility_id||'|'||:NEW.encounter_id ;
      v_app_err_msg :='Error occured during creation of message';
      sygenprc.register_error (:NEW.facility_id,
                               v_proc,
                               v_proc,
                               v_app_err_msg,
                               v_ora_err_msg,
                               v_app_err_key
                              );
      xhtracing.traces (v_proc,'Exception When No Data Found- ' || SQLERRM,'T');
   WHEN OTHERS
   THEN
      v_ora_err_msg := SQLCODE || '-' || SUBSTR (SQLERRM, 1, 3900);
      v_app_err_key := :NEW.facility_id||'|'||:NEW.encounter_id ;
      v_app_err_msg :='Error occured during insertion';
      sygenprc.register_error (:NEW.facility_id,
                               v_proc,
                               v_proc,
                               v_app_err_msg,
                               v_ora_err_msg,
                               v_app_err_key
                              );
      xhtracing.traces (v_proc, 'Exception When Others - ' || SQLERRM, 'T');
END;


/
ALTER TRIGGER "IBAEHIS"."XH_AFINUP_ENCOUNTER_PX1_OUT" ENABLE;
--------------------------------------------------------
--  DDL for Trigger IP_PR_ENCNTR_PRACT_TRG
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IBAEHIS"."IP_PR_ENCNTR_PRACT_TRG" 
   AFTER INSERT OR UPDATE
   ON PR_ENCOUNTER
   FOR EACH ROW
DECLARE
   NEXT_SRL_NO   NUMBER(2) := 0;
BEGIN
   IF INSERTING
   THEN
      -- The following logic is to insert a record for Admitting and Attending Practitioner's
      -- during Admission
      IF :NEW.ADT_STATUS IN('00', '01') AND :NEW.PATIENT_CLASS IN('IP', 'DC')
      THEN
         IF :NEW.ADMIT_PRACTITIONER_ID IS NOT NULL
         THEN
            INSERT INTO PR_ENCOUNTER_PRACT
                        (OPERATING_FACILITY_ID, ENCOUNTER_ID, PRACTITIONER_ID, PRACTITIONER_ROLE,
                         SPECIALTY_CODE, REMARKS, ADDED_BY_ID, ADDED_DATE,
                         ADDED_AT_WS_NO, ADDED_FACILITY_ID, MODIFIED_BY_ID,
                         MODIFIED_DATE, MODIFIED_AT_WS_NO, MODIFIED_FACILITY_ID,
                         TEAM_ID, NURSING_UNIT_CODE, ROLE_START_TIME, ROLE_END_TIME, SRL_NO)
                 VALUES (:NEW.FACILITY_ID, :NEW.ENCOUNTER_ID, :NEW.ADMIT_PRACTITIONER_ID, '1',
                         :NEW.SPECIALTY_CODE, NULL, :NEW.ADDED_BY_ID, :NEW.ADDED_DATE,
                         :NEW.ADDED_AT_WS_NO, :NEW.ADDED_FACILITY_ID, :NEW.MODIFIED_BY_ID,
                         :NEW.MODIFIED_DATE, :NEW.MODIFIED_AT_WS_NO, :NEW.MODIFIED_FACILITY_ID,
                         :NEW.TEAM_ID, :NEW.ASSIGN_CARE_LOCN_CODE, SYSDATE, NULL, 1);
         END IF;

         IF :NEW.ATTEND_PRACTITIONER_ID IS NOT NULL
         THEN
            SELECT NVL(MAX(SRL_NO), 0) + 1
              INTO NEXT_SRL_NO
              FROM PR_ENCOUNTER_PRACT
             WHERE OPERATING_FACILITY_ID = :NEW.FACILITY_ID
               AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID
               AND PRACTITIONER_ROLE = '4';

            INSERT INTO PR_ENCOUNTER_PRACT
                        (OPERATING_FACILITY_ID, ENCOUNTER_ID, PRACTITIONER_ID, PRACTITIONER_ROLE,
                         SPECIALTY_CODE, REMARKS, ADDED_BY_ID, ADDED_DATE,
                         ADDED_AT_WS_NO, ADDED_FACILITY_ID, MODIFIED_BY_ID,
                         MODIFIED_DATE, MODIFIED_AT_WS_NO, MODIFIED_FACILITY_ID,
                         TEAM_ID, NURSING_UNIT_CODE, ROLE_START_TIME, ROLE_END_TIME, SRL_NO)
                 VALUES (:NEW.FACILITY_ID, :NEW.ENCOUNTER_ID, :NEW.ATTEND_PRACTITIONER_ID, '4',
                         :NEW.SPECIALTY_CODE, NULL, :NEW.ADDED_BY_ID, :NEW.ADDED_DATE,
                         :NEW.ADDED_AT_WS_NO, :NEW.ADDED_FACILITY_ID, :NEW.MODIFIED_BY_ID,
                         :NEW.MODIFIED_DATE, :NEW.MODIFIED_AT_WS_NO, :NEW.MODIFIED_FACILITY_ID,
                         :NEW.TEAM_ID, :NEW.ASSIGN_CARE_LOCN_CODE, SYSDATE, NULL, NEXT_SRL_NO);
         END IF;
      END IF;
   END IF;

   IF UPDATING
   THEN
      -- The following logic is to insert a record for Attending Practitioner when an update
      -- occurs on PR_ENCOUNTER table. This will be invoked through the following functions
      -- Assign Bed
      -- Practitioner Transfer
      -- Transfer Patient
      -- Transfer Patient In
      IF :OLD.ADT_STATUS IN('00', '01')
      THEN
         IF :NEW.ATTEND_PRACTITIONER_ID IS NOT NULL
         THEN
            IF :OLD.ADT_STATUS = '01'
            THEN
               IF :NEW.ATTEND_PRACTITIONER_ID != NVL(:OLD.ATTEND_PRACTITIONER_ID, '_')
               THEN
                  SELECT NVL(MAX(SRL_NO), 0) + 1
                    INTO NEXT_SRL_NO
                    FROM PR_ENCOUNTER_PRACT
                   WHERE OPERATING_FACILITY_ID = :NEW.FACILITY_ID
                     AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID
                     AND PRACTITIONER_ROLE = '4';

                  INSERT INTO PR_ENCOUNTER_PRACT
                              (OPERATING_FACILITY_ID, ENCOUNTER_ID, PRACTITIONER_ID,
                               PRACTITIONER_ROLE, SPECIALTY_CODE, REMARKS, ADDED_BY_ID,
                               ADDED_DATE, ADDED_AT_WS_NO,
                               ADDED_FACILITY_ID, MODIFIED_BY_ID, MODIFIED_DATE,
                               MODIFIED_AT_WS_NO, MODIFIED_FACILITY_ID, TEAM_ID,
                               NURSING_UNIT_CODE, ROLE_START_TIME, ROLE_END_TIME, SRL_NO)
                       VALUES (:OLD.FACILITY_ID, :OLD.ENCOUNTER_ID, :NEW.ATTEND_PRACTITIONER_ID,
                               '4', :NEW.SPECIALTY_CODE, NULL, :NEW.MODIFIED_BY_ID,
                               :NEW.MODIFIED_DATE, :NEW.MODIFIED_AT_WS_NO,
                               :NEW.MODIFIED_FACILITY_ID, :NEW.MODIFIED_BY_ID, :NEW.MODIFIED_DATE,
                               :NEW.MODIFIED_AT_WS_NO, :NEW.MODIFIED_FACILITY_ID, :NEW.TEAM_ID,
                               :NEW.ASSIGN_CARE_LOCN_CODE, SYSDATE, NULL, NEXT_SRL_NO);

                  IF :OLD.ATTEND_PRACTITIONER_ID IS NOT NULL
                  THEN
                     UPDATE PR_ENCOUNTER_PRACT
                        SET ROLE_END_TIME = SYSDATE
                      WHERE OPERATING_FACILITY_ID = :OLD.FACILITY_ID
                        AND ENCOUNTER_ID = :OLD.ENCOUNTER_ID
                        AND PRACTITIONER_ID = :OLD.ATTEND_PRACTITIONER_ID
                        AND PRACTITIONER_ROLE = '4'
                        AND ROLE_END_TIME IS NULL;
                  END IF;
               END IF;
            END IF;

            IF     :OLD.ADT_STATUS = '00'
               AND :NEW.ATTEND_PRACTITIONER_ID != NVL(:OLD.ATTEND_PRACTITIONER_ID, '_')
            THEN
               SELECT NVL(MAX(SRL_NO), 0) + 1
                 INTO NEXT_SRL_NO
                 FROM PR_ENCOUNTER_PRACT
                WHERE OPERATING_FACILITY_ID = :NEW.FACILITY_ID
                  AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID
                  AND PRACTITIONER_ROLE = '4';

               INSERT INTO PR_ENCOUNTER_PRACT
                           (OPERATING_FACILITY_ID, ENCOUNTER_ID, PRACTITIONER_ID,
                            PRACTITIONER_ROLE, SPECIALTY_CODE, REMARKS, ADDED_BY_ID,
                            ADDED_DATE, ADDED_AT_WS_NO, ADDED_FACILITY_ID,
                            MODIFIED_BY_ID, MODIFIED_DATE, MODIFIED_AT_WS_NO,
                            MODIFIED_FACILITY_ID, TEAM_ID, NURSING_UNIT_CODE,
                            ROLE_START_TIME, ROLE_END_TIME, SRL_NO)
                    VALUES (:OLD.FACILITY_ID, :OLD.ENCOUNTER_ID, :NEW.ATTEND_PRACTITIONER_ID,
                            '4', :NEW.SPECIALTY_CODE, NULL, :NEW.MODIFIED_BY_ID,
                            :NEW.MODIFIED_DATE, :NEW.MODIFIED_AT_WS_NO, :NEW.MODIFIED_FACILITY_ID,
                            :NEW.MODIFIED_BY_ID, :NEW.MODIFIED_DATE, :NEW.MODIFIED_AT_WS_NO,
                            :NEW.MODIFIED_FACILITY_ID, :NEW.TEAM_ID, :NEW.ASSIGN_CARE_LOCN_CODE,
                            SYSDATE, NULL, NEXT_SRL_NO);

               IF :OLD.ATTEND_PRACTITIONER_ID IS NOT NULL
               THEN
                  UPDATE PR_ENCOUNTER_PRACT
                     SET ROLE_END_TIME = SYSDATE
                   WHERE OPERATING_FACILITY_ID = :OLD.FACILITY_ID
                     AND ENCOUNTER_ID = :OLD.ENCOUNTER_ID
                     AND PRACTITIONER_ID = :OLD.ATTEND_PRACTITIONER_ID
                     AND PRACTITIONER_ROLE = '4'
                     AND ROLE_END_TIME IS NULL;
               END IF;
            END IF;
         END IF;

         IF :NEW.ADMIT_PRACTITIONER_ID IS NOT NULL
         THEN
            IF :OLD.ADT_STATUS = '01'
            THEN
               IF :NEW.ADMIT_PRACTITIONER_ID != NVL(:OLD.ADMIT_PRACTITIONER_ID, '_')
               THEN
                  SELECT NVL(MAX(SRL_NO), 0) + 1
                    INTO NEXT_SRL_NO
                    FROM PR_ENCOUNTER_PRACT
                   WHERE OPERATING_FACILITY_ID = :NEW.FACILITY_ID
                     AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID
                     AND PRACTITIONER_ROLE = '1';

                  INSERT INTO PR_ENCOUNTER_PRACT
                              (OPERATING_FACILITY_ID, ENCOUNTER_ID, PRACTITIONER_ID,
                               PRACTITIONER_ROLE, SPECIALTY_CODE, REMARKS, ADDED_BY_ID,
                               ADDED_DATE, ADDED_AT_WS_NO,
                               ADDED_FACILITY_ID, MODIFIED_BY_ID, MODIFIED_DATE,
                               MODIFIED_AT_WS_NO, MODIFIED_FACILITY_ID, TEAM_ID,
                               NURSING_UNIT_CODE, ROLE_START_TIME, ROLE_END_TIME, SRL_NO)
                       VALUES (:OLD.FACILITY_ID, :OLD.ENCOUNTER_ID, :NEW.ADMIT_PRACTITIONER_ID,
                               '1', :NEW.SPECIALTY_CODE, NULL, :NEW.MODIFIED_BY_ID,
                               :NEW.MODIFIED_DATE, :NEW.MODIFIED_AT_WS_NO,
                               :NEW.MODIFIED_FACILITY_ID, :NEW.MODIFIED_BY_ID, :NEW.MODIFIED_DATE,
                               :NEW.MODIFIED_AT_WS_NO, :NEW.MODIFIED_FACILITY_ID, :NEW.TEAM_ID,
                               :NEW.ASSIGN_CARE_LOCN_CODE, SYSDATE, NULL, NEXT_SRL_NO);

                  IF :OLD.ADMIT_PRACTITIONER_ID IS NOT NULL
                  THEN
                     UPDATE PR_ENCOUNTER_PRACT
                        SET ROLE_END_TIME = SYSDATE
                      WHERE OPERATING_FACILITY_ID = :OLD.FACILITY_ID
                        AND ENCOUNTER_ID = :OLD.ENCOUNTER_ID
                        AND PRACTITIONER_ID = :OLD.ADMIT_PRACTITIONER_ID
                        AND PRACTITIONER_ROLE = '1'
                        AND ROLE_END_TIME IS NULL;
                  END IF;
               END IF;
            END IF;

            IF     :OLD.ADT_STATUS = '00'
               AND :NEW.ADMIT_PRACTITIONER_ID != NVL(:OLD.ADMIT_PRACTITIONER_ID, '_')
            THEN
               SELECT NVL(MAX(SRL_NO), 0) + 1
                 INTO NEXT_SRL_NO
                 FROM PR_ENCOUNTER_PRACT
                WHERE OPERATING_FACILITY_ID = :NEW.FACILITY_ID
                  AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID
                  AND PRACTITIONER_ROLE = '1';

               INSERT INTO PR_ENCOUNTER_PRACT
                           (OPERATING_FACILITY_ID, ENCOUNTER_ID, PRACTITIONER_ID,
                            PRACTITIONER_ROLE, SPECIALTY_CODE, REMARKS, ADDED_BY_ID,
                            ADDED_DATE, ADDED_AT_WS_NO, ADDED_FACILITY_ID,
                            MODIFIED_BY_ID, MODIFIED_DATE, MODIFIED_AT_WS_NO,
                            MODIFIED_FACILITY_ID, TEAM_ID, NURSING_UNIT_CODE,
                            ROLE_START_TIME, ROLE_END_TIME, SRL_NO)
                    VALUES (:OLD.FACILITY_ID, :OLD.ENCOUNTER_ID, :NEW.ADMIT_PRACTITIONER_ID,
                            '1', :NEW.SPECIALTY_CODE, NULL, :NEW.MODIFIED_BY_ID,
                            :NEW.MODIFIED_DATE, :NEW.MODIFIED_AT_WS_NO, :NEW.MODIFIED_FACILITY_ID,
                            :NEW.MODIFIED_BY_ID, :NEW.MODIFIED_DATE, :NEW.MODIFIED_AT_WS_NO,
                            :NEW.MODIFIED_FACILITY_ID, :NEW.TEAM_ID, :NEW.ASSIGN_CARE_LOCN_CODE,
                            SYSDATE, NULL, NEXT_SRL_NO);

               IF :OLD.ADMIT_PRACTITIONER_ID IS NOT NULL
               THEN
                  UPDATE PR_ENCOUNTER_PRACT
                     SET ROLE_END_TIME = SYSDATE
                   WHERE OPERATING_FACILITY_ID = :OLD.FACILITY_ID
                     AND ENCOUNTER_ID = :OLD.ENCOUNTER_ID
                     AND PRACTITIONER_ID = :OLD.ADMIT_PRACTITIONER_ID
                     AND PRACTITIONER_ROLE = '1'
                     AND ROLE_END_TIME IS NULL;
               END IF;
            END IF;
         END IF;
      END IF;

      -- The following logic is to update the role end time of all the practitioners
      -- while Discharge Patient
      IF :NEW.ADT_STATUS = '08' AND :OLD.PATIENT_CLASS IN('IP', 'DC')
      THEN
         UPDATE PR_ENCOUNTER_PRACT
            SET ROLE_END_TIME = SYSDATE
          WHERE OPERATING_FACILITY_ID = :OLD.FACILITY_ID
            AND ENCOUNTER_ID = :OLD.ENCOUNTER_ID
            AND ROLE_END_TIME IS NULL;
      END IF;

      -- The following logic is to delete all the practitioner assigned to the patinet
      -- while Cancelling Admission
      IF :NEW.ADT_STATUS = '09'
      THEN
         DELETE FROM PR_ENCOUNTER_PRACT
               WHERE OPERATING_FACILITY_ID = :OLD.FACILITY_ID AND ENCOUNTER_ID = :OLD.ENCOUNTER_ID;
      END IF;

      -- The following logic is to revert back the role end time of the admitting practitioner
      -- and attending practitioner while Cancelling Discharge
      IF :OLD.ADT_STATUS = '08' AND :NEW.ADT_STATUS = '01'
      THEN
         UPDATE PR_ENCOUNTER_PRACT
            SET ROLE_END_TIME = NULL
          WHERE OPERATING_FACILITY_ID = :OLD.FACILITY_ID
            AND ENCOUNTER_ID = :OLD.ENCOUNTER_ID
            AND PRACTITIONER_ROLE = 1
            AND SRL_NO = (SELECT MAX(SRL_NO) FROM PR_ENCOUNTER_PRACT
			  WHERE OPERATING_FACILITY_ID = :OLD.FACILITY_ID
			  AND ENCOUNTER_ID =:OLD.ENCOUNTER_ID
			  AND PRACTITIONER_ROLE = 1);
         UPDATE PR_ENCOUNTER_PRACT
            SET ROLE_END_TIME = NULL
          WHERE OPERATING_FACILITY_ID = :OLD.FACILITY_ID
            AND ENCOUNTER_ID = :OLD.ENCOUNTER_ID
            AND PRACTITIONER_ROLE = 4
            AND SRL_NO = (SELECT MAX(SRL_NO) FROM PR_ENCOUNTER_PRACT
			  WHERE OPERATING_FACILITY_ID = :OLD.FACILITY_ID
			  AND ENCOUNTER_ID =:OLD.ENCOUNTER_ID
			  AND PRACTITIONER_ROLE = 4);
      END IF;
   END IF;
END IP_PR_ENCNTR_PRACT_TRG;


/
ALTER TRIGGER "IBAEHIS"."IP_PR_ENCNTR_PRACT_TRG" ENABLE;
--------------------------------------------------------
--  DDL for Trigger FM_UPDATE_DISCH_AND_RET_DATE
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IBAEHIS"."FM_UPDATE_DISCH_AND_RET_DATE" 
   AFTER UPDATE OF visit_status, adt_status
   ON pr_encounter
   FOR EACH ROW
      WHEN (   NEW.discharge_date_time IS NOT NULL
         OR NEW.visit_status = '07'
         OR NEW.adt_status = '08'
        ) DECLARE
   CURSOR file_out
   IS
      SELECT a.patient_id, a.file_no, a.volume_no, a.curr_fs_locn_code,
             a.curr_fs_locn_identity, a.curr_holder_user_id,
             NVL (b.no_of_dh_to_return_ip, 0) no_of_dh_to_return_ip,
             NVL (b.no_of_dh_to_return_op, 0) no_of_dh_to_return_op,
             b.return_criteria, b.duration_type
        FROM fm_curr_locn a, fm_storage_locn b
       WHERE a.curr_locn_id = :NEW.assign_care_locn_code
         AND a.facility_id = :NEW.facility_id
         AND a.patient_id = :NEW.patient_id
         AND a.facility_id = b.facility_id
         AND a.curr_fs_locn_code = b.fs_locn_code
         AND a.curr_file_status = 'O';

   v_err              VARCHAR2 (1000 CHAR);
   p_incompl_locn     VARCHAR2 (8 CHAR);
   p_incompl_iden     VARCHAR2 (1 CHAR);
   p_incompl_holder   VARCHAR2 (30 CHAR);
   p_count            NUMBER;
   p_holi_date        fm_curr_locn.return_date_time%TYPE;
   p_holi_date1       fm_curr_locn.return_date_time%TYPE;
   no_rec             NUMBER;
   q_query            VARCHAR2 (1000 CHAR);
   flag               VARCHAR2 (10 CHAR)                   := 'TRUE';
   v_result           VARCHAR2 (2 CHAR);
   v_week_day_no      NUMBER;
   v_week_no          NUMBER;
BEGIN
   IF :NEW.discharge_date_time IS NOT NULL
   THEN
      SELECT COUNT (*)
        INTO p_count
        FROM sm_module
       WHERE module_id = 'FM' AND install_yn = 'Y';

      IF p_count = 1
      THEN
         BEGIN
            IF    :NEW.visit_status = '07'
               OR :NEW.visit_status = '09'
               OR :NEW.adt_status = '08'
            THEN
               UPDATE fm_tracer_card
                  SET cr_dis_date = :NEW.discharge_date_time,
                      modified_by_id = :NEW.modified_by_id,
                      modified_date = SYSDATE,
                      modified_at_ws_no = :NEW.modified_at_ws_no,
                      modified_facility_id = :NEW.facility_id
                WHERE facility_id = :NEW.facility_id AND file_no =
                                                                  :NEW.file_no;

               FOR p IN file_out
               LOOP
                  UPDATE fm_tracer_card
                     SET prev_op_patient_class = :NEW.patient_class,
                         prev_op_location = :NEW.assign_care_locn_code,
                         prev_op_encounter_date = :NEW.visit_adm_date_time,
                         prev_op_encounter_id = :NEW.encounter_id,
                         prev_op_adm_date = :NEW.visit_adm_date_time,
                         modified_by_id = :NEW.modified_by_id,
                         modified_date = SYSDATE,
                         modified_at_ws_no = :NEW.modified_at_ws_no,
                         modified_facility_id = :NEW.facility_id
                   WHERE facility_id = :NEW.facility_id
                         AND file_no = p.file_no;
               END LOOP;
            ELSIF :NEW.adt_status = '08'
            THEN
               FOR p IN file_out
               LOOP
                  UPDATE fm_tracer_card
                     SET prev_ip_patient_class = :NEW.patient_class,
                         prev_ip_location = :NEW.assign_care_locn_code,
                         prev_ip_encounter_date = :NEW.visit_adm_date_time,
                         prev_ip_encounter_id = :NEW.encounter_id,
                         prev_ip_adm_date = :NEW.visit_adm_date_time,
                         prev_ip_dis_date = :NEW.discharge_date_time,
                         modified_by_id = :NEW.modified_by_id,
                         modified_date = SYSDATE,
                         modified_at_ws_no = :NEW.modified_at_ws_no,
                         modified_facility_id = :NEW.facility_id
                   WHERE facility_id = :NEW.facility_id
                         AND file_no = p.file_no;
               END LOOP;
            END IF;
         END;

         SELECT a.dflt_incomplete_fs_locn_code, b.locn_identity, b.holder_name
           INTO p_incompl_locn, p_incompl_iden, p_incompl_holder
           FROM fm_parameter a, fm_storage_locn b
          WHERE a.facility_id = b.facility_id
            AND a.dflt_incomplete_fs_locn_code = b.fs_locn_code
            AND a.facility_id = :NEW.facility_id;

         IF p_incompl_locn IS NOT NULL
         THEN                              -- If there is  incomplete location
            IF :NEW.visit_status = '07' OR :NEW.adt_status = '08'
            THEN
               FOR p IN file_out
               LOOP
                  INSERT INTO fm_movement_log
                              (facility_id, file_no, sent_date_time,
                               patient_id, src_facility_id,
                               src_fs_locn_code, src_locn_identity,
                               src_user_id, dest_facility_id,
                               rec_date_time, dest_fs_locn_code,
                               dest_locn_identity, dest_user_id,
                               movement_type, src_mr_locn_yn,
                               dest_mr_locn_yn, added_by_id, added_date,
                               added_at_ws_no,
                               added_facility_id,
                               modified_by_id, modified_date,
                               modified_at_ws_no,
                               modified_facility_id, volume_no
                              )
                       VALUES (:NEW.facility_id, p.file_no, SYSDATE,
                               :NEW.patient_id, :NEW.facility_id,
                               p.curr_fs_locn_code, p.curr_fs_locn_identity,
                               p.curr_holder_user_id, :NEW.facility_id,
                               SYSDATE, p_incompl_locn,
                               p_incompl_iden, p_incompl_holder,
                               'F', 'N',
                               'N', :NEW.modified_by_id, SYSDATE,
                               :NEW.modified_at_ws_no,
                               :NEW.modified_facility_id,
                               :NEW.modified_by_id, SYSDATE,
                               :NEW.modified_at_ws_no,
                               :NEW.modified_facility_id, p.volume_no
                              );

                  UPDATE fm_curr_locn
                     SET iss_date_time = SYSDATE,
                         curr_facility_id = :NEW.facility_id,
                         curr_file_status = 'O',
                         curr_fs_locn_code = p_incompl_locn,
                         curr_fs_locn_identity = p_incompl_iden,
                         curr_holder_user_id = p_incompl_holder,
                         last_movement_date_time = SYSDATE,
                         prev_facility_id = :NEW.facility_id,
                         prev_fs_locn_code = p.curr_fs_locn_code,
                         prev_locn_id = :NEW.assign_care_locn_code,
                         curr_locn_id = '',
                         return_date_time = NULL,
                         modified_by_id = :NEW.modified_by_id,
                         modified_date = SYSDATE,
                         modified_at_ws_no = :NEW.modified_at_ws_no,
                         modified_facility_id = :NEW.facility_id
                   WHERE facility_id = :NEW.facility_id
                     AND file_no = p.file_no
                     AND volume_no = p.volume_no;

                  -- Updating  Return date and NIA Return Date - SCF-0112
                  IF :NEW.visit_status = '07' OR :NEW.adt_status = '08'
                  THEN
                     IF p.return_criteria = 'D'
                     THEN
                        IF :NEW.visit_status = '07'
                        THEN
                           IF p.duration_type = 'D'
                           THEN
                              p_holi_date :=
                                   :NEW.visit_status_set_on_date
                                 + p.no_of_dh_to_return_op;
                           ELSIF p.duration_type = 'H'
                           THEN
                              p_holi_date :=
                                   :NEW.visit_status_set_on_date
                                 + (1 / 24) * p.no_of_dh_to_return_op;
                           END IF;

                           p_holi_date1 := p_holi_date;

                           WHILE flag = 'TRUE'
                           LOOP
                              SELECT COUNT (*)
                                INTO no_rec
                                FROM oa_holiday
                               WHERE holiday_date = TRUNC (p_holi_date1)
                                 AND locn_code = :NEW.assign_care_locn_code
                                 AND facility_id = :NEW.facility_id;

                              IF no_rec = 0
                              THEN
                                 flag := 'FALSE';
                              ELSE
                                 p_holi_date1 := p_holi_date1 + 1;
                              END IF;
                           END LOOP;

                           UPDATE fm_curr_locn
                              SET return_date_time = p_holi_date,
                                  nia_return_date = p_holi_date1,
                                  modified_by_id = :NEW.modified_by_id,
                                  modified_date = SYSDATE,
                                  modified_at_ws_no = :NEW.modified_at_ws_no,
                                  modified_facility_id = :NEW.facility_id
                            WHERE facility_id = :NEW.facility_id
                              AND file_no = p.file_no
                              AND volume_no = p.volume_no;
                        ELSIF :NEW.adt_status = '08'
                        THEN
                           IF p.duration_type = 'D'
                           THEN
                              p_holi_date :=
                                   :NEW.discharge_date_time
                                 + p.no_of_dh_to_return_ip;
                           ELSIF p.duration_type = 'H'
                           THEN
                              p_holi_date :=
                                   :NEW.discharge_date_time
                                 + (1 / 24) * p.no_of_dh_to_return_ip;
                           END IF;

                           p_holi_date1 := p_holi_date;

                           WHILE flag = 'TRUE'
                           LOOP
                              SELECT day_no
                                INTO v_week_day_no
                                FROM sm_day_of_week
                               WHERE day_of_week =
                                          TRIM (TO_CHAR (p_holi_date1, 'DAY'));

                              v_week_no := get_week_of_month (p_holi_date1);
                              q_query :=
                                    'SELECT DAY_TYPE_WEEK_'
                                 || v_week_no
                                 || ' FROM

SM_DAY_OF_WEEK  WHERE DAY_NO = :V_WEEK_DAY_NO';

                  EXECUTE IMMEDIATE q_query
                               INTO v_result
                              USING v_week_day_no;

                  IF v_result = 'W'
                  THEN
                     flag := 'FALSE';
                  ELSIF v_result = 'H'
                  THEN
                     flag := 'TRUE';
                     p_holi_date1 := p_holi_date1 + 1;
                  END IF;
               END LOOP;

                           UPDATE fm_curr_locn
                              SET return_date_time = p_holi_date,
                                  nia_return_date = p_holi_date1,
                                  modified_by_id = :NEW.modified_by_id,
                                  modified_date = SYSDATE,
                                  modified_at_ws_no = :NEW.modified_at_ws_no,
                                  modified_facility_id = :NEW.facility_id
                            WHERE facility_id = :NEW.facility_id
                              AND file_no = p.file_no
                              AND volume_no = p.volume_no;
                        END IF;
                     END IF;
                  END IF;
               END LOOP;
            END IF;
         ELSE                             --If there is no incomplete location
            IF :NEW.visit_status = '07' OR :NEW.adt_status = '08'
            THEN
               FOR p IN file_out
               LOOP
                  IF p.return_criteria = 'D'
                  THEN
                     IF :NEW.visit_status = '07'
                     THEN
                        IF p.duration_type = 'D'
                        THEN
                           p_holi_date :=
                                :NEW.visit_status_set_on_date
                              + p.no_of_dh_to_return_op;
                        ELSIF p.duration_type = 'H'
                        THEN
                           p_holi_date :=
                                :NEW.visit_status_set_on_date
                              + (1 / 24) * p.no_of_dh_to_return_op;
                        END IF;

                        p_holi_date1 := p_holi_date;

                        WHILE flag = 'TRUE'
                        LOOP
                           SELECT COUNT (*)
                             INTO no_rec
                             FROM oa_holiday
                            WHERE holiday_date = TRUNC (p_holi_date1)
                              AND locn_code = :NEW.assign_care_locn_code
                              AND facility_id = :NEW.facility_id;

                           IF no_rec = 0
                           THEN
                              flag := 'FALSE';
                           ELSE
                              p_holi_date1 := p_holi_date1 + 1;
                           END IF;
                        END LOOP;

                        UPDATE fm_curr_locn
                           SET return_date_time = p_holi_date,
                               nia_return_date = p_holi_date1,
                               modified_by_id = :NEW.modified_by_id,
                               modified_date = SYSDATE,
                               modified_at_ws_no = :NEW.modified_at_ws_no,
                               modified_facility_id = :NEW.facility_id
                         WHERE facility_id = :NEW.facility_id
                           AND file_no = p.file_no
                           AND volume_no = p.volume_no;
                     ELSIF :NEW.adt_status = '08'
                     THEN
                        IF p.duration_type = 'D'
                        THEN
                           p_holi_date :=
                                :NEW.discharge_date_time
                              + p.no_of_dh_to_return_ip;
                        ELSIF p.duration_type = 'H'
                        THEN
                           p_holi_date :=
                                :NEW.discharge_date_time
                              + (1 / 24) * p.no_of_dh_to_return_ip;
                        END IF;

                        p_holi_date1 := p_holi_date;

                        WHILE flag = 'TRUE'
                        LOOP
                           SELECT day_no
                             INTO v_week_day_no
                             FROM sm_day_of_week
                            WHERE day_of_week =
                                          TRIM (TO_CHAR (p_holi_date1, 'DAY'));

                           v_week_no := get_week_of_month (p_holi_date1);
                           q_query :=
                                 'SELECT DAY_TYPE_WEEK_'
                              || v_week_no
                              || ' FROM

SM_DAY_OF_WEEK  WHERE DAY_NO = :V_WEEK_DAY_NO';

                           EXECUTE IMMEDIATE q_query
                                        INTO v_result
                                       USING v_week_day_no;

                           IF v_result = 'W'
                           THEN
                              flag := 'FALSE';
                           ELSIF v_result = 'H'
                           THEN
                              flag := 'TRUE';
                              p_holi_date1 := p_holi_date1 + 1;
                           END IF;
                        END LOOP;

                        UPDATE fm_curr_locn
                           SET return_date_time = p_holi_date,
                               nia_return_date = p_holi_date1,
                               modified_by_id = :NEW.modified_by_id,
                               modified_date = SYSDATE,
                               modified_at_ws_no = :NEW.modified_at_ws_no,
                               modified_facility_id = :NEW.facility_id
                         WHERE facility_id = :NEW.facility_id
                           AND file_no = p.file_no
                           AND volume_no = p.volume_no;
                     END IF;
                  END IF;
               END LOOP;
            END IF;
         END IF;
      END IF;
   END IF;
EXCEPTION
   WHEN OTHERS
   THEN
      NULL;
      v_err := SQLERRM;
--    DBMS_OUTPUT.PUT_LINE(V_ERR);
END;


/
ALTER TRIGGER "IBAEHIS"."FM_UPDATE_DISCH_AND_RET_DATE" ENABLE;
--------------------------------------------------------
--  DDL for Trigger XH_A01_A02_A03_A04_A11_A14_A27
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IBAEHIS"."XH_A01_A02_A03_A04_A11_A14_A27" 
After Insert or Update ON PR_ENCOUNTER For Each ROW
   WHEN (
NEW.patient_id = OLD.patient_id OR OLD.patient_id IS NULL
      ) DECLARE

v_event_type            xh_event.event_type%type;
v_message_type        xh_message_type.message_type%type;
v_interface_yn            xh_param.interface_yn%type;
v_filter_yn                xh_param.filter_yn%type;
v_current_facility        xh_event.facility_id%type;
v_fac_int_yn            varchar2(3);
v_action_type            xh_event.action_type%type;
v_triggering_event        varchar2(10);
v_event_interfaced_yn    varchar2(3);
v_visit_id                  xh_event.visit_id%type;
v_episode_type            xh_event.episode_type%type;
v_episode_id            xh_event.episode_id%type;
v_op_episode_visit_num     pr_encounter.op_episode_visit_num%type;
v_rules_exists_yn        varchar2(3);
v_ora_err_msg            SM_PROC_MSG.ERR_MSG%TYPE;
v_app_err_msg                 SM_PROC_MSG.APP_MSG%TYPE;
v_proc                SM_PROC_MSG.PROC_ID%TYPE := 'XH_A01_A02_A03_A04_A11_A14_A27' ;
v_failed_proc            SM_PROC_MSG.FAILED_PROC_ID%TYPE:='XH_A01_A02_A03_A04_A11_A14_A27' ;
v_app_err_key            SM_PROC_MSG.APP_KEY%TYPE;
v_assign_bed_num        pr_encounter.assign_bed_num%type;
v_assign_room_type          VARCHAR2(30);

BEGIN
        v_app_err_key:='PR_ENCOUNTER.ENCOUNTER_ID :'||    :NEW.Encounter_id;

        XHTRACING.G_PROG_ID:='XH_A01_A02_A03_A04_A11_A14_A27';
        XHTRACING.G_FLAG:=XHTRACING.ENABLE_OR_DISABLE_TRACING;

        -- Get interface parameters - whether interface enabled

        xhcore.get_interface_parameters (v_interface_yn,v_filter_yn);

            xhtracing.traces('XH_A01_A02_A03_A04_A11_A14_A27','Verify the Inteface Module is enabled Globally ='||v_interface_yn,'T');
                  xhtracing.traces('XH_A01_A02_A03_A04_A11_A14_A27','Verify the Filter is enbaled Globally ='||v_filter_yn,'T');


        xhcore.get_facility_parameters  (:NEW.facility_id,v_fac_int_yn);

            v_app_err_msg:='Current Transaction (Encounterfacility) = '||:NEW.facility_id;
            xhtracing.traces('XH_A01_A02_A03_A04_A11_A14_A27', v_app_err_msg, 'T');

            v_app_err_msg:='Verify the Current facility is enabled for interface = ='||    v_fac_int_yn;
                  xhtracing.traces('XH_A01_A02_A03_A04_A11_A14_A27',v_app_err_msg,'T');

