--------------------------------------------------------
--  DDL for Trigger PR_ENCOUNTER_HIST_TRG
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IBAEHIS"."PR_ENCOUNTER_HIST_TRG" 
BEFORE UPDATE OF PATIENT_ID
ON PR_ENCOUNTER
REFERENCING NEW AS NEW OLD AS OLD
FOR EACH ROW
   WHEN (
NEW.PATIENT_ID <> OLD.PATIENT_ID
      ) BEGIN
    INSERT INTO PR_ENCOUNTER_HIST
    (FACILITY_ID,ENCOUNTER_ID,NEW_PID,OLD_PID,
    ADDED_BY_ID,ADDED_DATE,ADDED_AT_WS_NO,ADDED_FACILITY_ID,
    MODIFIED_BY_ID,MODIFIED_DATE,MODIFIED_AT_WS_NO,MODIFIED_FACILITY_ID)
    VALUES
    (:NEW.FACILITY_ID, :NEW.ENCOUNTER_ID,:NEW.PATIENT_ID, :OLD.PATIENT_ID,
    :NEW.MODIFIED_BY_ID,:NEW.MODIFIED_DATE,:NEW.MODIFIED_AT_WS_NO,:NEW.MODIFIED_FACILITY_ID,
    :NEW.MODIFIED_BY_ID,:NEW.MODIFIED_DATE,:NEW.MODIFIED_AT_WS_NO,:NEW.MODIFIED_FACILITY_ID);
EXCEPTION
  WHEN OTHERS THEN NULL;
END;


