--  DDL for Trigger XH_AFUP_PR_ENCOUNTER_X01X02
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IBAEHIS"."XH_AFUP_PR_ENCOUNTER_X01X02" 
AFTER UPDATE ON PR_ENCOUNTER
FOR EACH ROW
   WHEN (
NEW.PATIENT_ID = NVL(OLD.PATIENT_ID,NEW.PATIENT_ID)
AND OLD.DISCHARGE_DATE_TIME IS NULL AND NEW.DISCHARGE_DATE_TIME IS NOT NULL
      ) DECLARE

    v_episode_type        xh_event.episode_type%type;
    v_episode_id        xh_event.episode_id%type;
    v_op_episode_visit_num    pr_encounter.op_episode_visit_num%type;
    v_assign_bed_num    pr_encounter.assign_bed_num%type;
    v_assign_room_type    VARCHAR2(30);

    v_interface_yn        XH_PARAM.INTERFACE_YN%TYPE;
    v_filter_yn        VARCHAR2(1);
    v_fac_int_yn        VARCHAR2(3);
    v_action_type        XH_EVENT.ACTION_TYPE%TYPE;
    v_event_interfaced_yn    VARCHAR2(3);
    v_message_id        XH_EVENT.MESSAGE_ID%TYPE;
    v_accession_num         XH_EVENT.ACCESSION_NUM%TYPE;
    v_message_type        VARCHAR2(10);

    v_app_err_key        SM_PROC_MSG.APP_KEY%TYPE;
    v_ora_err_msg        SM_PROC_MSG.ERR_MSG%TYPE;
    v_app_err_msg           SM_PROC_MSG.APP_MSG%TYPE;
    v_proc            SM_PROC_MSG.PROC_ID%TYPE := 'XH_AFUP_PR_ENCOUNTER_X01X02' ;
    v_failed_proc        SM_PROC_MSG.FAILED_PROC_ID%TYPE := 'XH_AFUP_PR_ENCOUNTER_X01X02' ;
    l_trans_status        VARCHAR2(1);
    l_out_errmsg        VARCHAR2(4000);

BEGIN

    XHTRACING.G_PROG_ID:='XH_AFUP_PR_ENCOUNTER_X01X02';
    XHTRACING.G_FLAG:=XHTRACING.ENABLE_OR_DISABLE_TRACING;

    v_app_err_key := 'Encounter Id :'||    :NEW.Encounter_id||chr(10)||
            'Patient Id :'||:NEW.patient_id||chr(10)||
            'Facility Id :'||:NEW.facility_id;
    xhtracing.traces(v_proc,v_app_err_key,'T');

    v_app_err_msg := 'Checking Interface/Filter Enabled or not...';
    xhtracing.traces(v_proc,v_app_err_msg,'T');

    xhcore.get_interface_parameters (v_interface_yn,v_filter_yn);
    xhtracing.traces(v_proc,'v_interface_yn - '||v_interface_yn||chr(10)||'v_filter_yn - '||v_filter_yn,'T');

    v_app_err_msg := 'Checking Interface Enabled for Facility or not...';
    xhtracing.traces(v_proc,v_app_err_msg,'T');

    xhcore.get_facility_parameters  (:NEW.facility_id,v_fac_int_yn);
    xhtracing.traces(v_proc,'v_fac_int_yn - '|| v_fac_int_yn,'T');

    IF UPPER (v_interface_yn) = 'Y' AND v_fac_int_yn = 'Y' THEN

        v_action_type := 'U';

        IF :NEW.patient_class = 'IP' THEN
            v_episode_type := 'I';
            v_episode_id := :NEW.encounter_id;
        ELSIF :NEW.patient_class = 'DC' THEN
            v_episode_type := 'D';
            v_episode_id := :NEW.encounter_id;
        ELSIF :NEW.patient_class = 'OP' THEN
            v_episode_type:= 'O';
            v_episode_id:=SUBSTR(:NEW.encounter_id,1,8);
            v_op_episode_visit_num := SUBSTR(:NEW.encounter_id,9);
        ELSIF :NEW.patient_class = 'EM' THEN
            v_episode_type:= 'E';
            v_episode_id:=SUBSTR(:NEW.encounter_id,1,8);
            v_op_episode_visit_num := SUBSTR(:NEW.encounter_id,9);
        ELSIF :NEW.patient_class = 'XT' THEN
            v_episode_type:= 'X';
            v_episode_id:=SUBSTR(:NEW.encounter_id,1,8);
            v_op_episode_visit_num := SUBSTR(:NEW.encounter_id,9);
        END IF;

        xhtracing.traces(v_proc,'v_episode_type - '||v_episode_type||chr(10)||
                    'v_episode_id - '||v_episode_id||chr(10)||
                    'v_op_episode_visit_num - '||v_op_episode_visit_num,'T');

        v_accession_num := :NEW.patient_id||'$!^'||:NEW.encounter_id||'$!^'||:NEW.patient_class||'$!^'||TO_CHAR(:NEW.visit_adm_date_time,'YYYYMMDDHH24MISS')
        ||'$!^'||TO_CHAR(:NEW.discharge_date_time,'YYYYMMDDHH24MISS')||'$!^'||:NEW.facility_id;

        xhtracing.traces(v_proc,'v_accession_num - '||v_accession_num,'T');

        v_message_type := 'CDX';

        v_app_err_msg:='Checking X01 Event is enabled or not...';
        xhtracing.traces(v_proc,v_app_err_msg,'T');

        xhcore.get_event_message_details('X01',v_message_type, v_event_interfaced_yn);
        xhtracing.traces(v_proc,'X01 v_event_interfaced_yn - '||v_event_interfaced_yn,'T');

        IF v_event_interfaced_yn = 'Y' THEN

            BEGIN

                v_app_err_msg:='Generating Message Id for X01...';
                xhtracing.traces(v_proc,v_app_err_msg,'T');

                SELECT    XH_HL7_MESSAGE_ID_SEQ.NEXTVAL
                INTO     v_message_id
                FROM     dual;

                XHTRACING.TRACES(v_proc,'Message Id ='|| v_message_id ,'T');

                v_app_err_msg:='Calling XHBASE.XH_EVENT_QUEUE_INS...';
                xhtracing.traces(v_proc,v_app_err_msg,'T');

                XHBASE.XH_EVENT_QUEUE_INS('XH','MYHIX2',v_message_id,:NEW.facility_id,
                                SYSDATE, 'X01',:NEW.patient_id,NULL,v_episode_type,
                                v_episode_id,v_op_episode_visit_num,v_accession_num,v_action_type,
                                NULL,NULL,NULL,
                                NULL,:NEW.modified_by_id,sysdate,
                                :NEW.modified_by_id,SYSDATE,:NEW.modified_at_ws_no,
                                :NEW.modified_facility_id, :NEW.modified_at_ws_no,
                                :NEW.modified_facility_id, NULL,NULL, NULL,NULL,
                                NULL,NULL,NULL,NULL,NULL,
                                NULL, NULL, NULL, NULL, NULL, NULL,
                                NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,
                                NULL, NULL,NULL, NULL, NULL, NULL, NULL, NULL,
                                NULL, NULL, NULL, l_trans_status,l_out_errmsg);

                xhtracing.traces (v_proc, 'l_trans_status - '||l_trans_status,'T');
                xhtracing.traces (v_proc, 'XHBASE.XH_EVENT_QUEUE_INS Procedure Execution Over - '||l_out_errmsg, 'T');

            EXCEPTION
                WHEN OTHERS THEN
                    v_ora_err_msg := SQLCODE || '-' || SUBSTR (SQLERRM, 1, 3900);
                    xhgenprc.register_error (:NEW.modified_facility_id,v_proc,'XHBASE.XH_EVENT_QUEUE_INS',v_app_err_msg,v_ora_err_msg,v_app_err_key);
                    xhtracing.traces (v_proc, 'Exception While calling XHBASE.XH_EVENT_QUEUE_INS procedure - ' || SQLERRM, 'T');
            END;

        END IF;

        v_app_err_msg:='Checking X02 Event is enabled or not...';
        xhtracing.traces(v_proc,v_app_err_msg,'T');

        xhcore.get_event_message_details('X02',v_message_type, v_event_interfaced_yn);
        xhtracing.traces(v_proc,'X02 v_event_interfaced_yn - '||v_event_interfaced_yn,'T');

        IF v_event_interfaced_yn = 'Y' THEN

            BEGIN

                v_app_err_msg:='Generating Message Id for X02...';
                xhtracing.traces(v_proc,v_app_err_msg,'T');

                SELECT    XH_HL7_MESSAGE_ID_SEQ.NEXTVAL
                INTO     v_message_id
                FROM     dual;

                XHTRACING.TRACES(v_proc,'Message Id ='|| v_message_id ,'T');

                v_app_err_msg:='Calling XHBASE.XH_EVENT_QUEUE_INS...';
                xhtracing.traces(v_proc,v_app_err_msg,'T');

                XHBASE.XH_EVENT_QUEUE_INS('XH','MYHIX2',v_message_id,:NEW.facility_id,
                                SYSDATE, 'X02',:NEW.patient_id,NULL,v_episode_type,
                                v_episode_id,v_op_episode_visit_num,v_accession_num,v_action_type,
                                NULL,NULL,NULL,
                                NULL,:NEW.modified_by_id,sysdate,
                                :NEW.modified_by_id,SYSDATE,:NEW.modified_at_ws_no,
                                :NEW.modified_facility_id, :NEW.modified_at_ws_no,
                                :NEW.modified_facility_id, NULL,NULL, NULL,NULL,
                                NULL,NULL,NULL,NULL,NULL,
                                NULL, NULL, NULL, NULL, NULL, NULL,
                                NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,
                                NULL, NULL,NULL, NULL, NULL, NULL, NULL, NULL,
                                NULL, NULL, NULL, l_trans_status,l_out_errmsg);

                xhtracing.traces (v_proc, 'l_trans_status - '||l_trans_status,'T');
                xhtracing.traces (v_proc, 'XHBASE.XH_EVENT_QUEUE_INS Procedure Execution Over - '||l_out_errmsg, 'T');

            EXCEPTION
                WHEN OTHERS THEN
                    v_ora_err_msg := SQLCODE || '-' || SUBSTR (SQLERRM, 1, 3900);
                    xhgenprc.register_error (:NEW.modified_facility_id,v_proc,'XHBASE.XH_EVENT_QUEUE_INS',v_app_err_msg,v_ora_err_msg,v_app_err_key);
                    xhtracing.traces (v_proc, 'Exception While calling XHBASE.XH_EVENT_QUEUE_INS procedure - ' || SQLERRM, 'T');
            END;

        END IF;

    END IF;


    xhtracing.traces (v_proc, 'Trigger Execution Over...', 'T');

EXCEPTION
    WHEN OTHERS THEN
        v_ora_err_msg:= sqlcode || '  ' ||substr(SQLERRM,1,3900);
        xhgenprc.register_error(:NEW.facility_id,v_proc,v_failed_proc,v_app_err_msg,v_ora_err_msg,v_app_err_key);
        xhtracing.traces (v_proc, 'Exception While '||v_app_err_msg||' - ' || SQLERRM, 'T');
END XH_AFUP_PR_ENCOUNTER_X01X02;


/
ALTER TRIGGER "IBAEHIS"."XH_AFUP_PR_ENCOUNTER_X01X02" ENABLE;
--------------------------------------------------------
--  DDL for Trigger PR_ENCOUNTER_TRG_02
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IBAEHIS"."PR_ENCOUNTER_TRG_02" 
BEFORE INSERT ON PR_ENCOUNTER
REFERENCING OLD AS OLD NEW AS NEW
FOR EACH ROW
DECLARE
	PAT_ID PR_ENCOUNTER.patient_id%TYPE;
	V_ENC_CNT NUMBER(12);
	V_CNT NUMBER(12);
	v_err  VARCHAR2(2000);
BEGIN
	BEGIN
		SELECT DISTINCT PATIENT_ID
			INTO PAT_ID
			FROM PR_ENCOUNTER
			WHERE FACILITY_ID = :NEW.FACILITY_ID
			AND EPISODE_ID = :NEW.EPISODE_ID;
		EXCEPTION
			WHEN NO_DATA_FOUND  -- Indicates New Patient ID for this :new.episode_id. So, should allow this transaction.
		THEN RETURN;
	END;
	IF PAT_ID = :NEW.patient_id  -- Indicates Same Patient ID for this :new.episode_id. So, allow this transaction.
		THEN RETURN;
	END IF;
	RAISE_APPLICATION_ERROR(-20001, 'Different Patient ID cannot have Same Episode ID');  -- Else raise EXCEPTION
END PR_ENCOUNTER_TRG_02;


/
ALTER TRIGGER "IBAEHIS"."PR_ENCOUNTER_TRG_02" ENABLE;
