  CREATE OR REPLACE TRIGGER "IBAEHIS"."MR_IPOP_MORB_MORT_SUMM_TRG" 
AFTER UPDATE OF DISCHARGE_DATE_TIME ON PR_ENCOUNTER
REFERENCING NEW AS NEW OLD AS OLD
FOR EACH ROW
   WHEN ( OLD.DISCHARGE_DATE_TIME IS NULL AND NEW.DISCHARGE_DATE_TIME IS NOT NULL  ) DECLARE
	V_DISCHARGE_DATE	DATE;
	V_DECEASED_DATE		DATE;
	V_DECD_MALE_1		NUMBER(4);
	V_DIS_MALE_1		NUMBER(4);
	V_DECD_FEMALE_1		NUMBER(4);
	V_DIS_FEMALE_1		NUMBER(4);
	V_DECD_MALE_2		NUMBER(4);
