	V_DIS_FEMALE_4		NUMBER(4);
	V_DECD_MALE_5		NUMBER(4);
	V_DIS_MALE_5		NUMBER(4);
	V_DECD_FEMALE_5		NUMBER(4);
	V_DIS_FEMALE_5		NUMBER(4);
	V_DECD_MALE_6		NUMBER(4);
	V_DIS_MALE_6		NUMBER(4);
	V_DECD_FEMALE_6		NUMBER(4);
	V_DIS_FEMALE_6		NUMBER(4);
	V_DECD_MALE_7		NUMBER(4);
	V_DIS_MALE_7		NUMBER(4);
	V_DECD_FEMALE_7		NUMBER(4);
	V_DIS_FEMALE_7		NUMBER(4);
	V_DECD_MALE_8		NUMBER(4);
	V_DIS_MALE_8		NUMBER(4);
	V_DECD_FEMALE_8		NUMBER(4);
	V_DIS_FEMALE_8		NUMBER(4);
	V_DECD_MALE_9		NUMBER(4);
	V_DIS_MALE_9		NUMBER(4);
	V_DECD_FEMALE_9		NUMBER(4);
	V_DIS_FEMALE_9		NUMBER(4);
	V_DECD_MALE_10		NUMBER(4);
	V_DIS_MALE_10		NUMBER(4);
	V_DECD_FEMALE_10	NUMBER(4);
	V_DIS_FEMALE_10		NUMBER(4);
	V_DECD_MALE_11		NUMBER(4);
	V_DIS_MALE_11		NUMBER(4);
	V_DECD_FEMALE_11	NUMBER(4);
	V_DIS_FEMALE_11		NUMBER(4);
	V_DECD_MALE_12		NUMBER(4);
	V_DIS_MALE_12		NUMBER(4);
	V_DECD_FEMALE_12	NUMBER(4);
	V_DIS_FEMALE_12		NUMBER(4);
	V_TOT_DECD_MALE		NUMBER(8);
	V_TOT_DIS_MALE		NUMBER(8);
	V_TOT_DECD_FEMALE	NUMBER(8);
	V_TOT_DIS_FEMALE	NUMBER(8);
	V_INCL_FOR_STAT_YN	VARCHAR2(1);
	RESULT			NUMBER(1);
	V_LOCN_CODE		PR_ENCOUNTER.ASSIGN_CARE_LOCN_CODE%TYPE;
	V_DISCHARGE		DATE;
	V_DECEASED		DATE;
	DIAG_STAGE		PR_PROBLEM.IP_DIAG_STAGE%TYPE;
	PATIENT_CLASS		AM_PATIENT_CLASS.PATIENT_CLASS%TYPE;
	V_SUPP_DIAG_RESULT	NUMBER(1) := 0;
	CURSOR C_MR_DIAG_RECODING_IP IS SELECT A.* FROM MR_DIAG_RECODING A
	  WHERE A.CURR_FACILITY_ID = :OLD.FACILITY_ID AND A.CURR_ENCOUNTER_ID = :OLD.ENCOUNTER_ID
	  AND A.PATIENT_CLASS = 'IP' AND A.IP_DIAG_STAGE = 'D'
	  AND A.TRN_SRL_NO = ( SELECT MAX(TRN_SRL_NO) FROM MR_DIAG_RECODING B WHERE
	  B.CURR_FACILITY_ID = A.CURR_FACILITY_ID AND B.CURR_ENCOUNTER_ID = A.CURR_ENCOUNTER_ID AND B.PATIENT_CLASS = 'IP'
	  AND B.IP_DIAG_STAGE = 'D');
	CURSOR C_MR_DIAG_RECODING_OP IS SELECT * FROM MR_DIAG_RECODING
	  WHERE CURR_FACILITY_ID = :OLD.FACILITY_ID AND CURR_ENCOUNTER_ID = :OLD.ENCOUNTER_ID
	  AND PATIENT_CLASS IN ('OP', 'EM');
	CURSOR C_MR_DIAG_RECODING_DTL_IP(V_PATIENT_ID VARCHAR2, V_SRL_NO NUMBER) IS
	  SELECT * FROM MR_DIAG_RECODING_DTL WHERE PATIENT_ID = V_PATIENT_ID
  	  AND SRL_NO = V_SRL_NO;
BEGIN
	BEGIN
		SELECT INCL_FOR_HOSP_OCCUP_CALC_YN INTO V_INCL_FOR_STAT_YN
		FROM IP_NURSING_UNIT
		WHERE FACILITY_ID = :NEW.FACILITY_ID
		AND NURSING_UNIT_CODE = :NEW.ASSIGN_CARE_LOCN_CODE;
	EXCEPTION WHEN OTHERS THEN
		V_INCL_FOR_STAT_YN := 'N';
	END;
	IF V_INCL_FOR_STAT_YN = 'Y' THEN
		IF :NEW.DISCHARGE_DATE_TIME IS NOT NULL AND :OLD.PATIENT_CLASS IN ('IP') AND :NEW.ADT_STATUS = '08' THEN
			V_DECEASED :=  TRUNC(:NEW.DECEASED_DATE_TIME);
			V_DISCHARGE := TRUNC(:NEW.DISCHARGE_DATE_TIME);
			SELECT
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)<12 AND C.SEX ='M' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_MALE_1,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)<12 AND C.SEX ='M' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_MALE_1,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)<12 AND C.SEX ='F' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_FEMALE_1,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)<12 AND C.SEX ='F' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_FEMALE_1,
			--      BETWEEN 1 -  4 YEARS
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=12 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 60 AND C.SEX ='M' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_MALE_4,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=12 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 60 AND C.SEX ='M' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_MALE_4,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=12 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 60 AND C.SEX ='F' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_FEMALE_4,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=12 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 60 AND C.SEX ='F' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_FEMALE_4,
			--      BETWEEN  5 -  11 YEARS
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=60 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 144 AND C.SEX ='M' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_MALE_11,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=60 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 144 AND C.SEX ='M' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_MALE_11,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=60 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 144 AND C.SEX ='F' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_FEMALE_11,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=60 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 144 AND C.SEX ='F' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_FEMALE_11,
			--      BETWEEN  12 -  19 YEARS
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=144 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 240 AND C.SEX ='M' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_MALE_20,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=144 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 240 AND C.SEX ='M' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_MALE_20,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=144 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 240 AND C.SEX ='F' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_FEMALE_20,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=144 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 240 AND C.SEX ='F' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_FEMALE_20,
			--      BETWEEN  20 -  24YEARS
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=240 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 300 AND C.SEX ='M' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_MALE_25,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=240 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 300 AND C.SEX ='M' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_MALE_25,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=240 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 300 AND C.SEX ='F' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_FEMALE_25,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=240 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 300 AND C.SEX ='F' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_FEMALE_25,
			--      BETWEEN  25 -  35YEARS
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=300 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 420 AND C.SEX ='M' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_MALE_35,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=300 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 420 AND C.SEX ='M' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_MALE_35,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=300 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 420 AND C.SEX ='F' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_FEMALE_35,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=300 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 420 AND C.SEX ='F' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_FEMALE_35,
			--      BETWEEN  35 -  45YEARS
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=420 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 540 AND C.SEX ='M' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_MALE_45,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=420 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 540 AND C.SEX ='M' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_MALE_45,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=420 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 540 AND C.SEX ='F' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_FEMALE_45,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=420 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 540 AND C.SEX ='F' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_FEMALE_45,
			--      BETWEEN  45 -  55YEARS
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=540 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 660 AND C.SEX ='M' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_MALE_55,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=540 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 660 AND C.SEX ='M' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_MALE_55,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=540 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 660 AND C.SEX ='F' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_FEMALE_55,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=540 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 660 AND C.SEX ='F' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_FEMALE_55,
			--      BETWEEN  55 -  65YEARS
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=660 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 780 AND C.SEX ='M' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_MALE_65,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=660 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 780 AND C.SEX ='M' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_MALE_65,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=660 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 780 AND C.SEX ='F' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_FEMALE_65,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=660 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 780 AND C.SEX ='F' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_FEMALE_65,
			--      BETWEEN  65 -  75YEARS
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=780 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 900 AND C.SEX ='M' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_MALE_75,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=780 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 900 AND C.SEX ='M' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_MALE_75,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=780 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 900 AND C.SEX ='F' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_FEMALE_75,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=780 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 900 AND C.SEX ='F' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_FEMALE_75,
			--      BETWEEN  75 - 85 YEARS
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=900 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 1020 AND C.SEX ='M' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_MALE_85,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=900 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 1020 AND C.SEX ='M' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_MALE_85,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=900 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 1020 AND C.SEX ='F' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_FEMALE_85,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=900 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 1020 AND C.SEX ='F' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_FEMALE_85,
			--      ABOVE 85 YEARS
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=1020 AND C.SEX ='M' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_MALE_ABV,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=1020 AND C.SEX ='M' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_MALE_ABV,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=1020 AND C.SEX ='F' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) DECD_FEMALE_ABV,
			(CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)>=1020 AND C.SEX ='F' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) DIS_FEMALE_ABV,
			--    GRAND TOTAL
			(CASE WHEN  C.SEX ='M' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) TOT_DECD_MALE,
			(CASE WHEN  C.SEX ='M' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) TOT_DIS_MALE,
			(CASE WHEN  C.SEX ='F' AND V_DECEASED IS NOT NULL THEN 1 ELSE 0 END) TOT_DECD_FEMALE,
			(CASE WHEN  C.SEX ='F' AND V_DISCHARGE IS NOT NULL THEN 1 ELSE 0 END) TOT_DIS_FEMALE
			INTO
			V_DECD_MALE_1,   V_DIS_MALE_1,   V_DECD_FEMALE_1,   V_DIS_FEMALE_1,
			V_DECD_MALE_2,   V_DIS_MALE_2,   V_DECD_FEMALE_2,   V_DIS_FEMALE_2,
			V_DECD_MALE_3,   V_DIS_MALE_3,   V_DECD_FEMALE_3,   V_DIS_FEMALE_3,
			V_DECD_MALE_4,   V_DIS_MALE_4,   V_DECD_FEMALE_4,   V_DIS_FEMALE_4,
			V_DECD_MALE_5, 	 V_DIS_MALE_5,   V_DECD_FEMALE_5,   V_DIS_FEMALE_5,
			V_DECD_MALE_6,   V_DIS_MALE_6,   V_DECD_FEMALE_6,   V_DIS_FEMALE_6,
			V_DECD_MALE_7,   V_DIS_MALE_7,   V_DECD_FEMALE_7,   V_DIS_FEMALE_7,
			V_DECD_MALE_8,   V_DIS_MALE_8,   V_DECD_FEMALE_8,   V_DIS_FEMALE_8,
			V_DECD_MALE_9,   V_DIS_MALE_9,   V_DECD_FEMALE_9,   V_DIS_FEMALE_9,
			V_DECD_MALE_10,  V_DIS_MALE_10,	 V_DECD_FEMALE_10,  V_DIS_FEMALE_10,
			V_DECD_MALE_11,	 V_DIS_MALE_11,  V_DECD_FEMALE_11,  V_DIS_FEMALE_11,
			V_DECD_MALE_12,  V_DIS_MALE_12,  V_DECD_FEMALE_12,  V_DIS_FEMALE_12,
			V_TOT_DECD_MALE, V_TOT_DIS_MALE, V_TOT_DECD_FEMALE, V_TOT_DIS_FEMALE
			FROM MP_PATIENT C
			WHERE
			C.PATIENT_ID  =  :OLD.PATIENT_ID;
			FOR X IN C_MR_DIAG_RECODING_IP
			LOOP
				-- START MAIN DIAGNOSIS FOR IP
				BEGIN
					SELECT 1 INTO RESULT
					FROM
					MR_IP_MORB_MORT_SUMMARY
					WHERE
					FACILITY_ID     = X.CURR_FACILITY_ID AND
					DIAG_CODE	= X.RECODED_DIAG_CODE AND
					TRUNC(DISCHARGE_DATE)	= TRUNC(V_DISCHARGE);
				EXCEPTION WHEN NO_DATA_FOUND THEN
					RESULT := 0 ;
				END;
				IF RESULT = 1  THEN
					UPDATE MR_IP_MORB_MORT_SUMMARY
					SET
					DECD_MALE_1	= DECD_MALE_1		+ V_DECD_MALE_1 ,
					DIS_MALE_1	= DIS_MALE_1		+ V_DIS_MALE_1,
					DECD_FEMALE_1	= DECD_FEMALE_1		+ V_DECD_FEMALE_1,
					DIS_FEMALE_1	= DIS_FEMALE_1		+ V_DIS_FEMALE_1,
					DECD_MALE_2	= DECD_MALE_2		+ V_DECD_MALE_2,
					DIS_MALE_2	= DIS_MALE_2		+ V_DIS_MALE_2,
					DECD_FEMALE_2	= DECD_FEMALE_2		+ V_DECD_FEMALE_2,
					DIS_FEMALE_2	= DIS_FEMALE_2		+ V_DIS_FEMALE_2,
					DECD_MALE_3	= DECD_MALE_3		+ V_DECD_MALE_3 ,
					DIS_MALE_3	= DIS_MALE_3		+ V_DIS_MALE_3,
					DECD_FEMALE_3	= DECD_FEMALE_3		+ V_DECD_FEMALE_3,
					DIS_FEMALE_3	= DIS_FEMALE_3		+ V_DIS_FEMALE_3,
					DECD_MALE_4	= DECD_MALE_4		+ V_DECD_MALE_4,
					DIS_MALE_4	= DIS_MALE_4		+ V_DIS_MALE_4,
					DECD_FEMALE_4	= DECD_FEMALE_4		+ V_DECD_FEMALE_4,
					DIS_FEMALE_4	= DIS_FEMALE_4		+ V_DIS_FEMALE_4,
					DECD_MALE_5	= DECD_MALE_5		+ V_DECD_MALE_5,
					DIS_MALE_5	= DIS_MALE_5		+ V_DIS_MALE_5,
					DECD_FEMALE_5	= DECD_FEMALE_5		+ V_DECD_FEMALE_5,
					DIS_FEMALE_5	= DIS_FEMALE_5		+ V_DIS_FEMALE_5,
					DECD_MALE_6	= DECD_MALE_6		+ V_DECD_MALE_6,
					DIS_MALE_6	= DIS_MALE_6		+ V_DIS_MALE_6,
					DECD_FEMALE_6	= DECD_FEMALE_6		+ V_DECD_FEMALE_6,
					DIS_FEMALE_6	= DIS_FEMALE_6		+ V_DIS_FEMALE_6,
					DECD_MALE_7	= DECD_MALE_7		+ V_DECD_MALE_7,
					DIS_MALE_7	= DIS_MALE_7		+ V_DIS_MALE_7,
					DECD_FEMALE_7	= DECD_FEMALE_7		+ V_DECD_FEMALE_7,
					DIS_FEMALE_7	= DIS_FEMALE_7		+ V_DIS_FEMALE_7,
					DECD_MALE_8	= DECD_MALE_8		+ V_DECD_MALE_8,
					DIS_MALE_8	= DIS_MALE_8		+ V_DIS_MALE_8,
					DECD_FEMALE_8	= DECD_FEMALE_8		+ V_DECD_FEMALE_8,
					DIS_FEMALE_8	= DIS_FEMALE_8		+ V_DIS_FEMALE_8,
					DECD_MALE_9	= DECD_MALE_9		+ V_DECD_MALE_9,
					DIS_MALE_9	= DIS_MALE_9		+ V_DIS_MALE_9,
					DECD_FEMALE_9	= DECD_FEMALE_9		+ V_DECD_FEMALE_9,
					DIS_FEMALE_9	= DIS_FEMALE_9		+ V_DIS_FEMALE_9,
					DECD_MALE_10	= DECD_MALE_10		+ V_DECD_MALE_10,
					DIS_MALE_10	= DIS_MALE_10		+ V_DIS_MALE_10,
					DECD_FEMALE_10	= DECD_FEMALE_10	+ V_DECD_FEMALE_10,
					DIS_FEMALE_10	= DIS_FEMALE_10		+ V_DIS_FEMALE_10,
					DECD_MALE_11	= DECD_MALE_11		+ V_DECD_MALE_11,
					DIS_MALE_11	= DIS_MALE_11		+ V_DIS_MALE_11,
					DECD_FEMALE_11	= DECD_FEMALE_11	+ V_DECD_FEMALE_11,
					DIS_FEMALE_11	= DIS_FEMALE_11		+ V_DIS_FEMALE_11,
					DECD_MALE_12	= DECD_MALE_12		+ V_DECD_MALE_12,
					DIS_MALE_12	= DIS_MALE_12		+ V_DIS_MALE_12,
					DECD_FEMALE_12	= DECD_FEMALE_12	+ V_DECD_FEMALE_12,
					DIS_FEMALE_12	= DIS_FEMALE_12		+ V_DIS_FEMALE_12,
					TOT_DECD_MALE	= TOT_DECD_MALE		+ V_TOT_DECD_MALE,
					TOT_DIS_MALE	= TOT_DIS_MALE		+ V_TOT_DIS_MALE,
					TOT_DECD_FEMALE	= TOT_DECD_FEMALE	+ V_TOT_DECD_FEMALE,
					TOT_DIS_FEMALE	= TOT_DIS_FEMALE	+ V_TOT_DIS_FEMALE,
					INCL_IN_TOT_YN = 'Y'
					WHERE
					FACILITY_ID	= X.CURR_FACILITY_ID AND
					DIAG_CODE	= X.RECODED_DIAG_CODE AND
					TRUNC(DISCHARGE_DATE)	= TRUNC(V_DISCHARGE);
				END IF;
				IF RESULT = 0 THEN
					INSERT INTO MR_IP_MORB_MORT_SUMMARY(
					FACILITY_ID, DIAG_CODE, DISCHARGE_DATE, DECEASED_DATE,
					DECD_MALE_1, DIS_MALE_1, DECD_FEMALE_1, DIS_FEMALE_1,
					DECD_MALE_2, DIS_MALE_2, DECD_FEMALE_2, DIS_FEMALE_2,
					DECD_MALE_3, DIS_MALE_3, DECD_FEMALE_3, DIS_FEMALE_3,
					DECD_MALE_4, DIS_MALE_4, DECD_FEMALE_4, DIS_FEMALE_4,
					DECD_MALE_5, DIS_MALE_5, DECD_FEMALE_5, DIS_FEMALE_5,
					DECD_MALE_6, DIS_MALE_6, DECD_FEMALE_6, DIS_FEMALE_6,
					DECD_MALE_7, DIS_MALE_7, DECD_FEMALE_7, DIS_FEMALE_7,
					DECD_MALE_8, DIS_MALE_8, DECD_FEMALE_8, DIS_FEMALE_8,
					DECD_MALE_9, DIS_MALE_9, DECD_FEMALE_9, DIS_FEMALE_9,
					DECD_MALE_10, DIS_MALE_10, DECD_FEMALE_10, DIS_FEMALE_10,
					DECD_MALE_11, DIS_MALE_11, DECD_FEMALE_11, DIS_FEMALE_11,
					DECD_MALE_12, DIS_MALE_12, DECD_FEMALE_12, DIS_FEMALE_12,
					TOT_DECD_MALE, TOT_DIS_MALE, TOT_DECD_FEMALE, TOT_DIS_FEMALE,
					INCL_IN_TOT_YN)
					VALUES(
					X.CURR_FACILITY_ID, X.RECODED_DIAG_CODE, V_DISCHARGE, V_DECEASED,
					V_DECD_MALE_1,   V_DIS_MALE_1,   V_DECD_FEMALE_1,   V_DIS_FEMALE_1,
					V_DECD_MALE_2,   V_DIS_MALE_2,   V_DECD_FEMALE_2,   V_DIS_FEMALE_2,
					V_DECD_MALE_3,   V_DIS_MALE_3,   V_DECD_FEMALE_3,   V_DIS_FEMALE_3,
					V_DECD_MALE_4,   V_DIS_MALE_4,   V_DECD_FEMALE_4,   V_DIS_FEMALE_4,
					V_DECD_MALE_5,   V_DIS_MALE_5,   V_DECD_FEMALE_5,   V_DIS_FEMALE_5,
					V_DECD_MALE_6,   V_DIS_MALE_6,   V_DECD_FEMALE_6,   V_DIS_FEMALE_6,
					V_DECD_MALE_7,   V_DIS_MALE_7,   V_DECD_FEMALE_7,   V_DIS_FEMALE_7,
					V_DECD_MALE_8,   V_DIS_MALE_8,   V_DECD_FEMALE_8,   V_DIS_FEMALE_8,
					V_DECD_MALE_9,   V_DIS_MALE_9,   V_DECD_FEMALE_9,   V_DIS_FEMALE_9,
					V_DECD_MALE_10,  V_DIS_MALE_10,  V_DECD_FEMALE_10,  V_DIS_FEMALE_10,
					V_DECD_MALE_11,  V_DIS_MALE_11,  V_DECD_FEMALE_11,  V_DIS_FEMALE_11,
					V_DECD_MALE_12,  V_DIS_MALE_12,  V_DECD_FEMALE_12,  V_DIS_FEMALE_12,
					V_TOT_DECD_MALE, V_TOT_DIS_MALE, V_TOT_DECD_FEMALE, V_TOT_DIS_FEMALE,'Y');
				END IF;
				-- END MAIN DIAGNOSIS FOR IP
				-- START SUPPORTING DIAGNOSIS FOR IP
				FOR Y IN C_MR_DIAG_RECODING_DTL_IP (X.PATIENT_ID, X.SRL_NO)
				LOOP
					BEGIN
						SELECT 1 INTO V_SUPP_DIAG_RESULT
						FROM
						MR_IP_MORB_MORT_SUMMARY
						WHERE
						FACILITY_ID     = X.CURR_FACILITY_ID AND
						DIAG_CODE	= Y.RECODE_SUPP_DIAG_CODE AND
						TRUNC(DISCHARGE_DATE)	= TRUNC(V_DISCHARGE);
					EXCEPTION WHEN NO_DATA_FOUND THEN
						V_SUPP_DIAG_RESULT := 0 ;
					END;
					IF V_SUPP_DIAG_RESULT = 1  THEN
						UPDATE MR_IP_MORB_MORT_SUMMARY
						SET
						DECD_MALE_1	= DECD_MALE_1		+ V_DECD_MALE_1 ,
						DIS_MALE_1	= DIS_MALE_1		+ V_DIS_MALE_1,
						DECD_FEMALE_1	= DECD_FEMALE_1		+ V_DECD_FEMALE_1,
						DIS_FEMALE_1	= DIS_FEMALE_1		+ V_DIS_FEMALE_1,
						DECD_MALE_2	= DECD_MALE_2		+ V_DECD_MALE_2,
						DIS_MALE_2	= DIS_MALE_2		+ V_DIS_MALE_2,
						DECD_FEMALE_2	= DECD_FEMALE_2		+ V_DECD_FEMALE_2,
						DIS_FEMALE_2	= DIS_FEMALE_2		+ V_DIS_FEMALE_2,
						DECD_MALE_3	= DECD_MALE_3		+ V_DECD_MALE_3 ,
						DIS_MALE_3	= DIS_MALE_3		+ V_DIS_MALE_3,
						DECD_FEMALE_3	= DECD_FEMALE_3		+ V_DECD_FEMALE_3,
						DIS_FEMALE_3	= DIS_FEMALE_3		+ V_DIS_FEMALE_3,
						DECD_MALE_4	= DECD_MALE_4		+ V_DECD_MALE_4,
						DIS_MALE_4	= DIS_MALE_4		+ V_DIS_MALE_4,
						DECD_FEMALE_4	= DECD_FEMALE_4		+ V_DECD_FEMALE_4,
						DIS_FEMALE_4	= DIS_FEMALE_4		+ V_DIS_FEMALE_4,
						DECD_MALE_5	= DECD_MALE_5		+ V_DECD_MALE_5,
						DIS_MALE_5	= DIS_MALE_5		+ V_DIS_MALE_5,
						DECD_FEMALE_5	= DECD_FEMALE_5		+ V_DECD_FEMALE_5,
						DIS_FEMALE_5	= DIS_FEMALE_5		+ V_DIS_FEMALE_5,
						DECD_MALE_6	= DECD_MALE_6		+ V_DECD_MALE_6,
						DIS_MALE_6	= DIS_MALE_6		+ V_DIS_MALE_6,
						DECD_FEMALE_6	= DECD_FEMALE_6		+ V_DECD_FEMALE_6,
						DIS_FEMALE_6	= DIS_FEMALE_6		+ V_DIS_FEMALE_6,
						DECD_MALE_7	= DECD_MALE_7		+ V_DECD_MALE_7,
						DIS_MALE_7	= DIS_MALE_7		+ V_DIS_MALE_7,
						DECD_FEMALE_7	= DECD_FEMALE_7		+ V_DECD_FEMALE_7,
						DIS_FEMALE_7	= DIS_FEMALE_7		+ V_DIS_FEMALE_7,
						DECD_MALE_8	= DECD_MALE_8		+ V_DECD_MALE_8,
						DIS_MALE_8	= DIS_MALE_8		+ V_DIS_MALE_8,
						DECD_FEMALE_8	= DECD_FEMALE_8		+ V_DECD_FEMALE_8,
						DIS_FEMALE_8	= DIS_FEMALE_8		+ V_DIS_FEMALE_8,
						DECD_MALE_9	= DECD_MALE_9		+ V_DECD_MALE_9,
						DIS_MALE_9	= DIS_MALE_9		+ V_DIS_MALE_9,
						DECD_FEMALE_9	= DECD_FEMALE_9		+ V_DECD_FEMALE_9,
						DIS_FEMALE_9	= DIS_FEMALE_9		+ V_DIS_FEMALE_9,
						DECD_MALE_10	= DECD_MALE_10		+ V_DECD_MALE_10,
						DIS_MALE_10	= DIS_MALE_10		+ V_DIS_MALE_10,
						DECD_FEMALE_10	= DECD_FEMALE_10	+ V_DECD_FEMALE_10,
						DIS_FEMALE_10	= DIS_FEMALE_10		+ V_DIS_FEMALE_10,
						DECD_MALE_11	= DECD_MALE_11		+ V_DECD_MALE_11,
						DIS_MALE_11	= DIS_MALE_11		+ V_DIS_MALE_11,
						DECD_FEMALE_11	= DECD_FEMALE_11	+ V_DECD_FEMALE_11,
						DIS_FEMALE_11	= DIS_FEMALE_11		+ V_DIS_FEMALE_11,
						DECD_MALE_12	= DECD_MALE_12		+ V_DECD_MALE_12,
						DIS_MALE_12	= DIS_MALE_12		+ V_DIS_MALE_12,
						DECD_FEMALE_12	= DECD_FEMALE_12	+ V_DECD_FEMALE_12,
						DIS_FEMALE_12	= DIS_FEMALE_12		+ V_DIS_FEMALE_12,
						TOT_DECD_MALE	= TOT_DECD_MALE		+ V_TOT_DECD_MALE,
						TOT_DIS_MALE	= TOT_DIS_MALE		+ V_TOT_DIS_MALE,
						TOT_DECD_FEMALE	= TOT_DECD_FEMALE	+ V_TOT_DECD_FEMALE,
						TOT_DIS_FEMALE	= TOT_DIS_FEMALE	+ V_TOT_DIS_FEMALE,
						INCL_IN_TOT_YN = 'N'
						WHERE
						FACILITY_ID	= X.CURR_FACILITY_ID AND
						DIAG_CODE	= Y.RECODE_SUPP_DIAG_CODE AND
						TRUNC(DISCHARGE_DATE)	= TRUNC(V_DISCHARGE);
					END IF;
					IF V_SUPP_DIAG_RESULT = 0 THEN
						INSERT INTO MR_IP_MORB_MORT_SUMMARY(
						FACILITY_ID, DIAG_CODE, DISCHARGE_DATE, DECEASED_DATE,
						DECD_MALE_1, DIS_MALE_1, DECD_FEMALE_1, DIS_FEMALE_1,
						DECD_MALE_2, DIS_MALE_2, DECD_FEMALE_2, DIS_FEMALE_2,
						DECD_MALE_3, DIS_MALE_3, DECD_FEMALE_3, DIS_FEMALE_3,
						DECD_MALE_4, DIS_MALE_4, DECD_FEMALE_4, DIS_FEMALE_4,
						DECD_MALE_5, DIS_MALE_5, DECD_FEMALE_5, DIS_FEMALE_5,
						DECD_MALE_6, DIS_MALE_6, DECD_FEMALE_6, DIS_FEMALE_6,
						DECD_MALE_7, DIS_MALE_7, DECD_FEMALE_7, DIS_FEMALE_7,
						DECD_MALE_8, DIS_MALE_8, DECD_FEMALE_8, DIS_FEMALE_8,
						DECD_MALE_9, DIS_MALE_9, DECD_FEMALE_9, DIS_FEMALE_9,
						DECD_MALE_10, DIS_MALE_10, DECD_FEMALE_10, DIS_FEMALE_10,
						DECD_MALE_11, DIS_MALE_11, DECD_FEMALE_11, DIS_FEMALE_11,
						DECD_MALE_12, DIS_MALE_12, DECD_FEMALE_12, DIS_FEMALE_12,
						TOT_DECD_MALE, TOT_DIS_MALE, TOT_DECD_FEMALE, TOT_DIS_FEMALE,
						INCL_IN_TOT_YN)
						VALUES(
						X.CURR_FACILITY_ID, Y.RECODE_SUPP_DIAG_CODE, V_DISCHARGE,V_DECEASED,
						V_DECD_MALE_1,   V_DIS_MALE_1,   V_DECD_FEMALE_1,   V_DIS_FEMALE_1,
						V_DECD_MALE_2,   V_DIS_MALE_2,   V_DECD_FEMALE_2,   V_DIS_FEMALE_2,
						V_DECD_MALE_3,   V_DIS_MALE_3,   V_DECD_FEMALE_3,   V_DIS_FEMALE_3,
						V_DECD_MALE_4,   V_DIS_MALE_4,   V_DECD_FEMALE_4,   V_DIS_FEMALE_4,
						V_DECD_MALE_5,   V_DIS_MALE_5,   V_DECD_FEMALE_5,   V_DIS_FEMALE_5,
						V_DECD_MALE_6,   V_DIS_MALE_6,   V_DECD_FEMALE_6,   V_DIS_FEMALE_6,
						V_DECD_MALE_7,   V_DIS_MALE_7,   V_DECD_FEMALE_7,   V_DIS_FEMALE_7,
						V_DECD_MALE_8,   V_DIS_MALE_8,   V_DECD_FEMALE_8,   V_DIS_FEMALE_8,
						V_DECD_MALE_9,   V_DIS_MALE_9,   V_DECD_FEMALE_9,   V_DIS_FEMALE_9,
						V_DECD_MALE_10,  V_DIS_MALE_10,  V_DECD_FEMALE_10,  V_DIS_FEMALE_10,
						V_DECD_MALE_11,  V_DIS_MALE_11,  V_DECD_FEMALE_11,  V_DIS_FEMALE_11,
						V_DECD_MALE_12,  V_DIS_MALE_12,  V_DECD_FEMALE_12,  V_DIS_FEMALE_12,
						V_TOT_DECD_MALE, V_TOT_DIS_MALE, V_TOT_DECD_FEMALE, V_TOT_DIS_FEMALE,'N');
					END IF;
					V_SUPP_DIAG_RESULT := 0;
				END LOOP;
				-- END SUPPORTING DIAGNOSIS FOR IP
			END LOOP;
		END IF;
	END IF;
	-- START MAIN DIAGNOSIS FOR OP
	IF :NEW.DISCHARGE_DATE_TIME IS NOT NULL AND :OLD.PATIENT_CLASS IN ('OP','EM') AND :OLD.VISIT_ADM_TYPE_IND IN ('F','E') THEN
		V_LOCN_CODE := :OLD.ASSIGN_CARE_LOCN_CODE;
		V_DISCHARGE := TRUNC(:NEW.DISCHARGE_DATE_TIME);
		SELECT
		--      LESS THAN 10 YEARS
		( CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH) < 120 AND C.SEX ='M' THEN 1 ELSE 0 END) DIS_MALE_10,
		( CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH) < 120 AND C.SEX ='F' THEN 1 ELSE 0 END) DIS_FEMALE_10,
		--      BETWEEN 10 - 19 YEARS
		( CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH) >= 120 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 240 AND C.SEX ='M'  THEN 1 ELSE 0 END) DIS_MALE_20,
		( CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH) >= 120 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 240 AND C.SEX ='F'  THEN 1 ELSE 0 END) DIS_FEMALE_20,
		--      BETWEEN  20 -  59 YEARS
		( CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH) >= 240 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 720 AND C.SEX ='M'  THEN 1 ELSE 0 END) DIS_MALE_60,
		( CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH) >= 240 AND MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH)< 720 AND C.SEX ='F'  THEN 1 ELSE 0 END) DIS_FEMALE_60,
		--      ABOVE 60 YEARS
		( CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH) >= 720 AND C.SEX ='M'  THEN 1 ELSE 0 END) DIS_MALE_ABV,
		( CASE WHEN MONTHS_BETWEEN(V_DISCHARGE,C.DATE_OF_BIRTH) >= 720 AND C.SEX ='F'  THEN 1 ELSE 0 END) DIS_FEMALE_ABV,
		( CASE WHEN  C.SEX ='M'  THEN 1 ELSE 0 END) DIS_MALE_SUB,
		( CASE WHEN  C.SEX ='F'  THEN 1 ELSE 0 END) DIS_FEMALE_SUB
		INTO
		V_DIS_MALE_1, V_DIS_FEMALE_1,
		V_DIS_MALE_2, V_DIS_FEMALE_2,
		V_DIS_MALE_3, V_DIS_FEMALE_3,
		V_DIS_MALE_4, V_DIS_FEMALE_4,
		V_TOT_DIS_MALE,  V_TOT_DIS_FEMALE
		FROM MP_PATIENT C
		WHERE
		C.PATIENT_ID  =  :OLD.PATIENT_ID;
		FOR X IN C_MR_DIAG_RECODING_OP
		LOOP
			BEGIN
				SELECT 1 INTO RESULT
				FROM
				MR_OP_MORB_SUMMARY
				WHERE
				FACILITY_ID     = X.CURR_FACILITY_ID AND
				CLINIC_CODE	= V_LOCN_CODE AND
				PATIENT_CLASS	= X.PATIENT_CLASS AND
				DIAG_CODE	= X.RECODED_DIAG_CODE AND
				TRUNC(DISCHARGE_DATE)	= TRUNC(V_DISCHARGE);
			EXCEPTION WHEN NO_DATA_FOUND THEN
				RESULT := 0 ;
			END;
			IF RESULT = 1  THEN
				UPDATE MR_OP_MORB_SUMMARY
				SET
				DIS_MALE_1	= DIS_MALE_1	 + V_DIS_MALE_1,
				DIS_FEMALE_1	= DIS_FEMALE_1	 + V_DIS_FEMALE_1,
				DIS_MALE_2	= DIS_MALE_2	 + V_DIS_MALE_2,
				DIS_FEMALE_2	= DIS_FEMALE_2	 + V_DIS_FEMALE_2,
				DIS_MALE_3	= DIS_MALE_3	 + V_DIS_MALE_3,
				DIS_FEMALE_3	= DIS_FEMALE_3	 + V_DIS_FEMALE_3,
				DIS_MALE_4	= DIS_MALE_4	 + V_DIS_MALE_4,
				DIS_FEMALE_4	= DIS_FEMALE_4	 + V_DIS_FEMALE_4,
				TOT_DIS_MALE	= TOT_DIS_MALE	 + V_TOT_DIS_MALE,
				TOT_DIS_FEMALE	= TOT_DIS_FEMALE + V_TOT_DIS_FEMALE
				WHERE
				FACILITY_ID	= X.CURR_FACILITY_ID AND
				CLINIC_CODE	= V_LOCN_CODE AND
				PATIENT_CLASS	= X.PATIENT_CLASS AND
				DIAG_CODE	= X.RECODED_DIAG_CODE AND
				TRUNC(DISCHARGE_DATE)	= TRUNC(V_DISCHARGE);
			END IF;
			IF RESULT = 0 THEN
				INSERT INTO MR_OP_MORB_SUMMARY
				VALUES(
				X.CURR_FACILITY_ID, V_LOCN_CODE, X.PATIENT_CLASS,
				X.RECODED_DIAG_CODE, V_DISCHARGE,
				V_DIS_MALE_1,   V_DIS_FEMALE_1,
				V_DIS_MALE_2,   V_DIS_FEMALE_2,
				V_DIS_MALE_3,   V_DIS_FEMALE_3,
				V_DIS_MALE_4,   V_DIS_FEMALE_4,
				V_TOT_DIS_MALE, V_TOT_DIS_FEMALE);
			END IF;
			--START OF SUPPORTING DIAGNOSIS FOR OP
			FOR Y IN C_MR_DIAG_RECODING_DTL_IP (X.PATIENT_ID, X.SRL_NO)
			LOOP
				BEGIN
					SELECT 1 INTO RESULT
					FROM
					MR_OP_MORB_SUMMARY
					WHERE
					FACILITY_ID     = X.CURR_FACILITY_ID AND
					DIAG_CODE	= Y.RECODE_SUPP_DIAG_CODE AND
					TRUNC(DISCHARGE_DATE)	= TRUNC(V_DISCHARGE);
				EXCEPTION WHEN NO_DATA_FOUND THEN
						RESULT := 0 ;
				END;
				IF RESULT = 1  THEN
					UPDATE MR_OP_MORB_SUMMARY
					SET
					DIS_MALE_1	= DIS_MALE_1	 + V_DIS_MALE_1,
					DIS_FEMALE_1	= DIS_FEMALE_1	 + V_DIS_FEMALE_1,
					DIS_MALE_2	= DIS_MALE_2	 + V_DIS_MALE_2,
					DIS_FEMALE_2	= DIS_FEMALE_2	 + V_DIS_FEMALE_2,
					DIS_MALE_3	= DIS_MALE_3	 + V_DIS_MALE_3,
					DIS_FEMALE_3	= DIS_FEMALE_3	 + V_DIS_FEMALE_3,
					DIS_MALE_4	= DIS_MALE_4	 + V_DIS_MALE_4,
					DIS_FEMALE_4	= DIS_FEMALE_4	 + V_DIS_FEMALE_4,
					TOT_DIS_MALE	= TOT_DIS_MALE	 + V_TOT_DIS_MALE,
					TOT_DIS_FEMALE	= TOT_DIS_FEMALE + V_TOT_DIS_FEMALE
					WHERE
					FACILITY_ID	= X.CURR_FACILITY_ID AND
					CLINIC_CODE	= V_LOCN_CODE AND
					PATIENT_CLASS	= X.PATIENT_CLASS AND
					DIAG_CODE	= Y.RECODE_SUPP_DIAG_CODE AND
					TRUNC(DISCHARGE_DATE)	= TRUNC(V_DISCHARGE);
				END IF;
				IF RESULT = 0 THEN
					INSERT INTO MR_OP_MORB_SUMMARY
					VALUES(
					X.CURR_FACILITY_ID, V_LOCN_CODE, X.PATIENT_CLASS,
					Y.RECODE_SUPP_DIAG_CODE, V_DISCHARGE,
					V_DIS_MALE_1,   V_DIS_FEMALE_1,
					V_DIS_MALE_2,   V_DIS_FEMALE_2,
					V_DIS_MALE_3,   V_DIS_FEMALE_3,
					V_DIS_MALE_4,   V_DIS_FEMALE_4,
					V_TOT_DIS_MALE, V_TOT_DIS_FEMALE);
				END IF;
					RESULT := 0;
			END LOOP;
		--END OF SUPPORTING DIAGNOSIS OP
		END LOOP;
	END IF;
	UPDATE MR_DIAG_RECODING
	SET
	DISCHARGE_DATE_TIME = :NEW.DISCHARGE_DATE_TIME,
	DECEASED_DATE_TIME  = :NEW.DECEASED_DATE_TIME
	WHERE
	CURR_FACILITY_ID  = :OLD.FACILITY_ID AND
	CURR_ENCOUNTER_ID = :OLD.ENCOUNTER_ID;
END MR_IPOP_MORB_MORT_SUMM_TRG;


/
ALTER TRIGGER "IBAEHIS"."MR_IPOP_MORB_MORT_SUMM_TRG" ENABLE;
--------------------------------------------------------
--  DDL for Trigger PR_ENCNTR_MVMT_TRG
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IBAEHIS"."PR_ENCNTR_MVMT_TRG" 
AFTER INSERT OR UPDATE  ON PR_ENCOUNTER
FOR EACH ROW
DECLARE
 L_SRL_NO    VARCHAR2(3 CHAR) := NULL;
BEGIN
 IF INSERTING THEN
  SELECT NVL(MAX(to_number(SRL_NO)),0)+1 INTO L_SRL_NO FROM PR_PATIENT_MOVEMENT
  WHERE FACILITY_ID = :NEW.ADDED_FACILITY_ID AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID;
  INSERT INTO  PR_PATIENT_MOVEMENT
  (
  FACILITY_ID, ENCOUNTER_ID, SRL_NO,PATIENT_ID, PATIENT_CLASS, MOVEMENT_TYPE, FROM_LOCN_TYPE,
  FROM_LOCN_CODE, FROM_TIME, TO_LOCN_TYPE, TO_LOCN_CODE, TO_TIME, ADDED_BY_ID, ADDED_DATE,
  ADDED_AT_WS_NO, ADDED_FACILITY_ID, MODIFIED_BY_ID, MODIFIED_DATE, MODIFIED_AT_WS_NO,
  MODIFIED_FACILITY_ID
  )
  VALUES
  (
  :NEW.FACILITY_ID, :NEW.ENCOUNTER_ID, L_SRL_NO, :NEW.PATIENT_ID, :NEW.PATIENT_CLASS,
  'A', NULL, NULL, NULL,
  DECODE(:NEW.PATIENT_CLASS, 'DC', 'Y', :NEW.ASSIGN_CARE_LOCN_TYPE),
  DECODE(:NEW.PATIENT_CLASS, 'DC', :NEW.DC_UNIT_CODE, :NEW.ASSIGN_CARE_LOCN_CODE),
  SYSDATE,
  :NEW.ADDED_BY_ID, :NEW.ADDED_DATE, :NEW.ADDED_AT_WS_NO, :NEW.ADDED_FACILITY_ID,
  :NEW.MODIFIED_BY_ID, :NEW.MODIFIED_DATE, :NEW.MODIFIED_AT_WS_NO, :NEW.MODIFIED_FACILITY_ID
  );
 ELSIF UPDATING THEN
  IF :OLD.ASSIGN_CARE_LOCN_CODE <>:NEW.ASSIGN_CARE_LOCN_CODE THEN
   SELECT NVL(MAX(to_number(SRL_NO)),0)+1 INTO L_SRL_NO FROM PR_PATIENT_MOVEMENT
   WHERE FACILITY_ID = :NEW.ADDED_FACILITY_ID AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID;
   INSERT INTO  PR_PATIENT_MOVEMENT
   (
   FACILITY_ID, ENCOUNTER_ID, SRL_NO,PATIENT_ID, PATIENT_CLASS, MOVEMENT_TYPE, FROM_LOCN_TYPE,
   FROM_LOCN_CODE, FROM_TIME, TO_LOCN_TYPE, TO_LOCN_CODE, TO_TIME, ADDED_BY_ID, ADDED_DATE,
   ADDED_AT_WS_NO, ADDED_FACILITY_ID, MODIFIED_BY_ID, MODIFIED_DATE, MODIFIED_AT_WS_NO,
   MODIFIED_FACILITY_ID
   )
   VALUES(
   :NEW.FACILITY_ID, :NEW.ENCOUNTER_ID, L_SRL_NO, :NEW.PATIENT_ID, :NEW.PATIENT_CLASS,
   'A', NULL, NULL, NULL,
   DECODE(:NEW.PATIENT_CLASS, 'DC', 'Y', :NEW.ASSIGN_CARE_LOCN_TYPE),
   DECODE(:NEW.PATIENT_CLASS, 'DC', :NEW.DC_UNIT_CODE, :NEW.ASSIGN_CARE_LOCN_CODE),
   SYSDATE,
   :NEW.ADDED_BY_ID, :NEW.ADDED_DATE, :NEW.ADDED_AT_WS_NO, :NEW.ADDED_FACILITY_ID,
   :NEW.MODIFIED_BY_ID, :NEW.MODIFIED_DATE, :NEW.MODIFIED_AT_WS_NO, :NEW.MODIFIED_FACILITY_ID
   );
  END IF;
 END IF;
EXCEPTION WHEN OTHERS THEN
 NULL;
END PR_ENCNTR_MVMT_TRG;


/
ALTER TRIGGER "IBAEHIS"."PR_ENCNTR_MVMT_TRG" ENABLE;
--------------------------------------------------------
--  DDL for Trigger CA_PR_ENCNTR_TRG_AU01
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IBAEHIS"."CA_PR_ENCNTR_TRG_AU01" 
AFTER UPDATE OF VISIT_STATUS,ADT_STATUS,ATTEND_PRACTITIONER_ID ON PR_ENCOUNTER
FOR EACH ROW
DECLARE
l_insert_flag		BOOLEAN := FALSE;
l_end_date_time		DATE;
L_expiry_rule		ca_pract_reln.expiry_rule%type;
L_expiry_period		number;
l_pract_reln_id         ca_pract_reln.pract_reln_id%type:=null;
l_establish_reln_req_yn VARCHAR2(1 CHAR);
l_direct_yn             VARCHAR2(1 CHAR);
CURSOR CA_ENCNTR_PRACT_RELN_CUR IS
       SELECT a.expiry_rule,a.expiry_period
	 FROM ca_pract_reln a, ca_encntr_pract_reln b
       WHERE a.pract_reln_id     =  b.pract_reln_id
	  AND a.expiry_rule in ('DAT','HAT','HAD','DAD')
	  AND (b.end_date_time > sysdate or b.end_date_time IS NULL)
	  AND NVL(b.status,'01') ='01'
	  AND b.facility_id  = :new.facility_id
	  AND b.encounter_id = :new.encounter_id
       FOR UPDATE OF END_DATE_TIME;
BEGIN
  IF CA_GET_RELN_EXISTS= 'Y' THEN
     IF  :new.patient_class IN ('OP','EM') THEN
       IF :new.visit_status = '99' THEN  -- OP(CANCEL)
              -- The following code for Cancel admission or cancel Visit
	      UPDATE ca_encntr_pract_reln
	      SET status	  = '99'
              WHERE facility_id  = :new.facility_id
	         AND encounter_id = :new.encounter_id;
        ELSIF :new.attend_practitioner_id <> nvl(:old.attend_practitioner_id,'!!!!') AND
                 :new.attend_practitioner_id IS NOT NULL  THEN
		UPDATE ca_encntr_pract_reln
		SET  end_date_time	= sysdate
		  ,  status='09'
		WHERE  facility_id	= :new.facility_id
		  AND  encounter_id	= :new.encounter_id
		  AND  practitioner_id  = :old.attend_practitioner_id
		  AND  nvl(status,'01')='01'
		  AND  end_date_time<SYSDATE;
		l_pract_reln_id:=CA_GET_PRACT_RELATIONSHIP(:new.SPECIALTY_CODE,:new.patient_class);
		IF l_pract_reln_id IS NOT NULL THEN
		   INSERT INTO CA_ENCNTR_PRACT_RELN(facility_id, encounter_id, pract_reln_id, practitioner_id, patient_id, patient_class, begin_date_time, end_date_time, direct_yn,status, added_by_id, added_date, added_at_ws_no, added_facility_id,
		    modified_by_id, modified_date, modified_at_ws_no, modified_facility_id)		VALUES(:new.facility_id,:new.encounter_id,l_pract_reln_id,
		   :new.attend_practitioner_id,:new.patient_id,:new.patient_class,:new.visit_adm_date_time,null,'N','01',		:new.added_by_id,:new.added_date,:new.added_at_ws_no,:new.added_facility_id,	:new.modified_by_id,:new.modified_date, :new.modified_at_ws_no,:new.modified_facility_id);
		END IF;
	  END IF;
       ELSE   -- IP
	  IF :new.attend_practitioner_id <> nvl(:old.attend_practitioner_id,'!!!!') AND
                 :new.attend_practitioner_id IS NOT NULL  THEN
		UPDATE ca_encntr_pract_reln
		SET  end_date_time	= sysdate
		  ,  status='09'
		WHERE  facility_id	= :new.facility_id
		  AND  encounter_id	= :new.encounter_id
		  AND  practitioner_id  = :old.attend_practitioner_id
		  AND  nvl(status,'01')='01'
		  AND  end_date_time<SYSDATE;
	     IF  :new.patient_class IN ('DC') THEN
		l_pract_reln_id:=CA_GET_PRACT_RELATIONSHIP(:new.SPECIALTY_CODE,'DC');
	     ELSE
		l_pract_reln_id:=CA_GET_PRACT_RELATIONSHIP(:new.SPECIALTY_CODE,'IE');
	     END IF;
	     IF l_pract_reln_id IS NOT NULL THEN
	       INSERT INTO CA_ENCNTR_PRACT_RELN(facility_id, encounter_id, pract_reln_id, practitioner_id,
                                     patient_id, patient_class, begin_date_time, end_date_time, direct_yn,status,
                     added_by_id, added_date, added_at_ws_no, added_facility_id,
                     modified_by_id, modified_date, modified_at_ws_no, modified_facility_id)
        VALUES(:new.facility_id,:new.encounter_id,l_pract_reln_id,:new.attend_practitioner_id,
        :new.patient_id,:new.patient_class,:new.visit_adm_date_time,null,'N','01',
        :new.added_by_id,:new.added_date,:new.added_at_ws_no,:new.added_facility_id,
        :new.modified_by_id,:new.modified_date, :new.modified_at_ws_no, :new.modified_facility_id);
           END IF;
      ELSIF :new.adt_status = '09' THEN  -- IP(CANCEL)
              UPDATE ca_encntr_pract_reln
             SET status      = '09'
               WHERE facility_id  = :new.facility_id
             AND encounter_id = :new.encounter_id;
          END IF;
       END IF;
       IF :new.adt_status   = '08' OR :new.visit_status = '07' OR
          :new.visit_status = '08' OR :new.visit_status = '09' THEN -- discharge patient and  check out
           FOR I IN CA_ENCNTR_PRACT_RELN_CUR
               LOOP
                    l_expiry_period := i.expiry_period;
            IF I.expiry_rule IN ('HAT','HAD') THEN
            l_expiry_period := I.expiry_period/24;
             END IF;
             IF  :new.visit_status IN('07','08','09') THEN
            l_end_date_time := sysdate + l_expiry_period;
             ELSE
            l_end_date_time := :new.discharge_date_time + l_expiry_period;
             END IF;
             UPDATE ca_encntr_pract_reln
                SET end_date_time = l_end_date_time
             WHERE CURRENT OF CA_ENCNTR_PRACT_RELN_CUR;
        END LOOP;
     END IF;
  END IF;
EXCEPTION WHEN OTHERS THEN NULL;
END;


/
ALTER TRIGGER "IBAEHIS"."CA_PR_ENCNTR_TRG_AU01" ENABLE;
--------------------------------------------------------
--  DDL for Trigger PR_ENCOUNTER_AE_BLK_RLS_BED
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IBAEHIS"."PR_ENCOUNTER_AE_BLK_RLS_BED" 
   AFTER INSERT OR UPDATE
   ON pr_encounter
   REFERENCING NEW AS NEW OLD AS OLD
   FOR EACH ROW
      WHEN (NEW.patient_class='EM' AND (NEW.ASSIGN_BED_NUM IS NOT NULL OR OLD.ASSIGN_BED_NUM IS NOT NULL)) BEGIN
IF INSERTING THEN
	IF :NEW.ASSIGN_BED_NUM IS NOT NULL AND NVL(:NEW.visit_status,'00') < '07' THEN  	/* Block the new Bed No */
		UPDATE ae_bed_for_trmt_area
		SET
		occupying_patient_id = :NEW.patient_id,
		current_status = 'O',
		occupied_until_date_time = NULL,
		modified_by_id = :NEW.modified_by_id,
		modified_date = :NEW.modified_date,
		modified_at_ws_no = :NEW.modified_at_ws_no,
		modified_facility_id = :NEW.modified_facility_id
		WHERE
		FACILITY_ID=:NEW.facility_id AND
		CLINIC_CODE=:NEW.ASSIGN_CARE_LOCN_CODE AND
		TREATMENT_AREA_CODE=:NEW.TREATMENT_AREA_CODE AND
		BED_NO=:NEW.ASSIGN_BED_NUM AND
		occupying_patient_id IS NULL;
	END IF;
END IF;

IF UPDATING THEN
	/* Release the Old Bed No */
	IF :OLD.ASSIGN_BED_NUM IS NOT NULL AND NVL(:NEW.visit_status,'00') < '07' THEN
		UPDATE ae_bed_for_trmt_area
		SET
		occupying_patient_id = NULL,
	        current_status = 'A',
		occupied_until_date_time = NULL,
	        modified_by_id = :NEW.modified_by_id,
	        modified_date = :NEW.modified_date,
		modified_at_ws_no = :NEW.modified_at_ws_no,
	        modified_facility_id = :NEW.modified_facility_id
		WHERE
		FACILITY_ID=:OLD.facility_id AND
		CLINIC_CODE=:OLD.ASSIGN_CARE_LOCN_CODE AND
		TREATMENT_AREA_CODE=:OLD.TREATMENT_AREA_CODE AND
		BED_NO=:OLD.ASSIGN_BED_NUM AND
		occupying_patient_id IS NOT NULL AND occupying_patient_id=:NEW.PATIENT_ID;
	END IF;
	/* Block the New Bed No */
	IF :NEW.ASSIGN_BED_NUM IS NOT NULL AND NVL(:NEW.visit_status,'00') < '07' THEN
		UPDATE ae_bed_for_trmt_area
		SET
		occupying_patient_id = :NEW.patient_id,
		current_status = 'O',
		occupied_until_date_time = NULL,
		modified_by_id = :NEW.modified_by_id,
		modified_date = :NEW.modified_date,
		modified_at_ws_no = :NEW.modified_at_ws_no,
		modified_facility_id = :NEW.modified_facility_id
		WHERE
		FACILITY_ID=:NEW.facility_id AND
		CLINIC_CODE=:NEW.ASSIGN_CARE_LOCN_CODE AND
		TREATMENT_AREA_CODE=:NEW.TREATMENT_AREA_CODE AND
		BED_NO=:NEW.ASSIGN_BED_NUM AND
		occupying_patient_id IS NULL;
	END IF;
	/* Release the New Bed No */
	IF :NEW.ASSIGN_BED_NUM IS NOT NULL AND :OLD.visit_status < '08'
		AND (:NEW.visit_status = '07' OR :NEW.visit_status = '09' OR :NEW.visit_status = '99') THEN
		UPDATE ae_bed_for_trmt_area
		 SET occupying_patient_id = NULL,
		     current_status = 'A',
		     occupied_until_date_time = NULL,
		     modified_by_id = :NEW.modified_by_id,
		     modified_date = :NEW.modified_date,
		     modified_at_ws_no = :NEW.modified_at_ws_no,
		     modified_facility_id = :NEW.modified_facility_id
		WHERE FACILITY_ID=:NEW.facility_id AND
		     CLINIC_CODE=:NEW.ASSIGN_CARE_LOCN_CODE AND
		     TREATMENT_AREA_CODE=:NEW.TREATMENT_AREA_CODE AND
		     BED_NO=:NEW.ASSIGN_BED_NUM AND
		     occupying_patient_id = :NEW.patient_id AND
		     occupying_patient_id IS NOT NULL;
	END IF;
END IF;
EXCEPTION
WHEN OTHERS THEN NULL;
END PR_ENCOUNTER_AE_BLK_RLS_BED;


/
ALTER TRIGGER "IBAEHIS"."PR_ENCOUNTER_AE_BLK_RLS_BED" ENABLE;
--------------------------------------------------------
--  DDL for Trigger MR_DEATH_REGISTER_TRG
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IBAEHIS"."MR_DEATH_REGISTER_TRG" 
AFTER UPDATE ON PR_ENCOUNTER
FOR EACH ROW
   WHEN (NEW.PATIENT_CLASS IN ('OP','EM') AND ( (NEW.VISIT_STATUS = '07' AND NEW.DECEASED_DATE_TIME IS NOT NULL)
	OR (NEW.DECEASED_DATE_TIME IS NULL AND OLD.DECEASED_DATE_TIME IS NOT NULL))) DECLARE
	P_CNT NUMBER	 := 0;
	V_CNT_DEL NUMBER := 0;
BEGIN
	/* Mark the patient as deceased */
	SELECT COUNT(*) INTO P_CNT FROM MR_DEATH_REGISTER_HDR WHERE FACILITY_ID = :NEW.FACILITY_ID AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID;
	IF P_CNT=0 AND :NEW.DECEASED_DATE_TIME IS NOT NULL THEN
		INSERT INTO MR_DEATH_REGISTER_HDR
			( FACILITY_ID, ENCOUNTER_ID, PATIENT_ID,
			DEATH_DATE_TIME, REMARKS, DEATH_BY_PREGNANCY_YN,
			AUTOPSY_YN, MEDICAL_LEGAL_CASE_YN, FINALIZE_YN, AUTH_PRACTITIONER_ID,
			ATTEND_PRACTITIONER_ID, GESTATIONAL_UNIT, GESTATIONAL_PERIOD,
			POL_REP_NO, POL_STN_ID, POL_ID, NATIONAL_ID_NO, PRACT_REG_NO,
			BROUGHT_DEAD_YN, ADDL_FIELD1, ADDL_FIELD2,
			ADDL_FIELD3, ADDL_FIELD4, ADDL_FIELD5,
			ADDED_BY_ID, ADDED_DATE, ADDED_AT_WS_NO, ADDED_FACILITY_ID,
			MODIFIED_BY_ID, MODIFIED_DATE, MODIFIED_AT_WS_NO, MODIFIED_FACILITY_ID, PM_YN)
		VALUES
			(:NEW.FACILITY_ID, :NEW.ENCOUNTER_ID, :NEW.PATIENT_ID,
			:NEW.DECEASED_DATE_TIME, NULL /* REMARKS */, NULL /* DEATH_BY_PREGNANCY_YN */,
			'N' /*AUTOPSY_YN*/, :NEW.MLC_YN, 'N' /* FINALIZE_YN */, NULL,
			:NEW.ATTEND_PRACTITIONER_ID,  NULL /* :NEW.GESTATIONAL_UNIT */, NULL /* :NEW.GESTATIONAL_PERIOD */,
			:NEW.POL_REP_NO, :NEW.POL_STN_ID, :NEW.POL_ID, NULL, /*NATIONAL_ID_NO*/ NULL,/*PRACT_REG_NO*/
			DECODE(:NEW.PATIENT_CLASS,'EM',:NEW.BROUGHT_DEAD_YN,'N'), NULL /* :NEW.ADDL_FIELD1 */, NULL /* :NEW.ADDL_FIELD2 */,
			NULL /* :NEW.ADDL_FIELD3 */, NULL /* :NEW.ADDL_FIELD4 */, NULL /* :NEW.ADDL_FIELD5 */,
			:NEW.MODIFIED_BY_ID, :NEW.MODIFIED_DATE, :NEW.MODIFIED_AT_WS_NO, :NEW.MODIFIED_FACILITY_ID,
			:NEW.MODIFIED_BY_ID, :NEW.MODIFIED_DATE, :NEW.MODIFIED_AT_WS_NO, :NEW.MODIFIED_FACILITY_ID, :NEW.PM_YN);
	ELSIF P_CNT != 0 AND :NEW.DECEASED_DATE_TIME IS NOT NULL THEN
		UPDATE MR_DEATH_REGISTER_HDR SET PM_YN = :NEW.PM_YN
		WHERE FACILITY_ID = :NEW.FACILITY_ID
		AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID;
	END IF;
	IF  :NEW.DECEASED_DATE_TIME IS NOT NULL THEN
		UPDATE OP_PATIENT_QUEUE SET DECEASED_DATE_TIME = :NEW.DECEASED_DATE_TIME
		WHERE FACILITY_ID=:NEW.FACILITY_ID AND ENCOUNTER_ID=:NEW.ENCOUNTER_ID;
	ELSE
		UPDATE OP_PATIENT_QUEUE SET DECEASED_DATE_TIME = NULL
		WHERE FACILITY_ID=:NEW.FACILITY_ID AND ENCOUNTER_ID=:NEW.ENCOUNTER_ID;
		UPDATE MP_PATIENT
		   SET DECEASED_YN = 'N',
		       DECEASED_DATE = NULL,
		       DEATH_STATUS_REMARKS = NULL,
		       DECEASED_FACILITY_ID = NULL,
		       DECEASED_ENCOUNTER_ID  = NULL,
		       MODIFIED_BY_ID = :NEW.MODIFIED_BY_ID,
		       MODIFIED_DATE = SYSDATE,
		       MODIFIED_AT_WS_NO = :NEW.MODIFIED_AT_WS_NO,
		       MODIFIED_FACILITY_ID = :NEW.MODIFIED_FACILITY_ID
		 WHERE PATIENT_ID = :OLD.PATIENT_ID;
	END IF;
	IF :OLD.DECEASED_DATE_TIME IS NOT NULL AND :NEW.DECEASED_DATE_TIME IS NULL THEN
		DELETE FROM PR_SUPPORT_DIAGNOSIS
		WHERE	PATIENT_ID = :NEW.PATIENT_ID
		AND	RECORDED_FROM_DEATH_REG_YN = 'Y';
		DELETE FROM PR_DIFFERENTIAL_DIAGNOSIS
		WHERE	PATIENT_ID = :NEW.PATIENT_ID
		AND	RECORDED_FROM_DEATH_REG_YN = 'Y';
		DELETE FROM PR_DIAGNOSIS_EVIDENCE
		WHERE	PATIENT_ID = :NEW.PATIENT_ID
		AND	RECORDED_FROM_DEATH_REG_YN = 'Y';
		DELETE FROM PR_DIAGNOSIS_DETAIL
		WHERE	PATIENT_ID = :NEW.PATIENT_ID
		AND	RECORDED_FROM_DEATH_REG_YN = 'Y';
		DELETE FROM PR_DIAGNOSIS_STATUS
		WHERE	FACILITY_ID = :NEW.FACILITY_ID
		AND	ENCOUNTER_ID = :NEW.ENCOUNTER_ID
		AND	RECORDED_FROM_DEATH_REG_YN = 'Y';
		DELETE FROM PR_DIAGNOSIS_ENC_ERR_LOG
		WHERE	FACILITY_ID = :NEW.FACILITY_ID
		AND	ENCOUNTER_ID = :NEW.ENCOUNTER_ID
		AND	RECORDED_FROM_DEATH_REG_YN = 'Y';

		SELECT COUNT(*)
		INTO V_CNT_DEL
		FROM MR_DIAGNOSIS_RECODING_DTL
		WHERE FACILITY_ID = :NEW.FACILITY_ID
		AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID
		AND RECORDED_FROM_DEATH_REG_YN != 'Y'
		AND ACTIVE_YN ='Y';

		DELETE FROM MR_RECODE_SUPPORT_DIAG
		WHERE PATIENT_ID = :NEW.PATIENT_ID
		AND FACILITY_ID = :NEW.FACILITY_ID
		AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID
		AND SUPPORT_SEQ_NO IN (SELECT SUPPORT_SEQ_NO
					FROM MR_DIAGNOSIS_RECODING_DTL
					WHERE FACILITY_ID = :NEW.FACILITY_ID
					AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID
					AND RECORDED_FROM_DEATH_REG_YN = 'Y');
		IF V_CNT_DEL = 0 THEN
			SELECT COUNT(*)
			INTO V_CNT_DEL
			FROM MR_PROCEDURE_RECODING_DTL
			WHERE FACILITY_ID = :NEW.FACILITY_ID
			AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID
			AND ACTIVE_YN ='Y';
                END IF;

		DELETE FROM MR_DIAGNOSIS_RECODING_DTL
		WHERE	FACILITY_ID = :NEW.FACILITY_ID
		AND	ENCOUNTER_ID = :NEW.ENCOUNTER_ID
		AND	RECORDED_FROM_DEATH_REG_YN = 'Y';

                IF V_CNT_DEL = 0 THEN
		DELETE FROM MR_DIAG_PROC_RECODING_HDR
		WHERE	FACILITY_ID = :NEW.FACILITY_ID
		AND	ENCOUNTER_ID = :NEW.ENCOUNTER_ID;
		END IF;

		UPDATE MR_DIAGNOSIS_RECODING_DTL
		SET CAUSE_OF_DEATH = 'N'
		WHERE FACILITY_ID = :NEW.FACILITY_ID
		AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID
		AND RECORDED_FROM_DEATH_REG_YN = 'N';


		DELETE FROM PR_DIAGNOSIS_ENC_DTL
		WHERE	FACILITY_ID = :NEW.FACILITY_ID
		AND	ENCOUNTER_ID = :NEW.ENCOUNTER_ID
		AND	RECORDED_FROM_DEATH_REG_YN = 'Y';
		DELETE FROM PR_DIAGNOSIS
		WHERE	ONSET_FACILITY_ID = :NEW.FACILITY_ID
		AND	ONSET_ENCOUNTER_ID = :NEW.ENCOUNTER_ID
		AND	RECORDED_FROM_DEATH_REG_YN = 'Y';
		DELETE FROM MR_DEATH_REGISTER_AUDIT
		WHERE	FACILITY_ID = :NEW.FACILITY_ID
		AND	ENCOUNTER_ID = :NEW.ENCOUNTER_ID;
		DELETE FROM MR_DEATH_REGISTER_DIAG_DTL
		      WHERE FACILITY_ID = :NEW.FACILITY_ID
			    AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID;
		DELETE FROM MR_DEATH_REGISTER_HDR
		      WHERE FACILITY_ID = :NEW.FACILITY_ID
			    AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID;
	END IF;
END;


/
ALTER TRIGGER "IBAEHIS"."MR_DEATH_REGISTER_TRG" ENABLE;
--------------------------------------------------------
--  DDL for Trigger IP_PR_ENCNTR_UPD_OPEN_ENC_TRG
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IBAEHIS"."IP_PR_ENCNTR_UPD_OPEN_ENC_TRG" 
BEFORE UPDATE ON PR_ENCOUNTER
REFERENCING NEW AS NEW OLD AS OLD FOR EACH ROW
   WHEN (
NEW.PATIENT_CLASS IN ('IP','DC')
      ) DECLARE
    P_DIS_ACK_SRL_NO NUMBER(12) := 0;
    P_ENC_COUNT NUMBER(2) := 0;
    V_SEX_IND VARCHAR2(1);
    V_MAX_SRL_NO NUMBER(4);
    V_MAX_SRL_NO_CAN_DIS NUMBER(4);
    V_TRN_CODE  IP_ADT_TRN.TRN_CODE%TYPE;
    V_DEPT_CODE VARCHAR2(10);
    OCC_PATID VARCHAR2(20);
    OCC_BABY_BED VARCHAR2(10);
    BED_LENGTH NUMBER(2) :=0;
    PAT_LENGTH NUMBER(2) :=0;
    V_BABY_PATIENT_ID IP_DISCHARGE_ADVICE.BABY_PATIENT_ID%TYPE;
    V_BABY_BED_NO IP_DISCHARGE_ADVICE.BABY_BED_NO%TYPE;
    V_BED_LEN NUMBER(2):=0;
    V_PATID_LEN NUMBER(2):=0;
BEGIN
	IF :NEW.ADT_STATUS NOT IN ('08', '09') THEN
		-- The following logic is to update IP_OPEN_ENCOUNTER table when an update happens on
		-- PR_ENCOUNTER table.
		UPDATE IP_OPEN_ENCOUNTER A SET
		PATIENT_CLASS  = :NEW.PATIENT_CLASS,
		REFERRAL_ID  = :NEW.REFERRAL_ID,
		BOOKING_CASE_YN  = :NEW.BOOKING_CASE_YN,
		BOOKING_REF_NO  = :NEW.BOOKING_REF_NO,
		CHIEF_COMPLAINT  = :NEW.CHIEF_COMPLAINT,
		BACKDATED_YN  = :NEW.BACKDATED_YN,
		ADMISSION_TYPE  = :NEW.VISIT_ADM_TYPE,
		ADMISSION_TYPE_IND = :NEW.VISIT_ADM_TYPE_IND,
		ADMIT_PRACTITIONER_ID = :NEW.ADMIT_PRACTITIONER_ID,
		TEAM_ID   = :NEW.TEAM_ID,
		ATTEND_PRACTITIONER_ID = :NEW.ATTEND_PRACTITIONER_ID,
		NURSING_UNIT_CODE  = :NEW.ASSIGN_CARE_LOCN_CODE,
		SPECIALTY_CODE  = :NEW.SPECIALTY_CODE,
		SERVICE_CODE  = :NEW.SERVICE_CODE,
		SUBSERVICE_CODE  = :NEW.SUBSERVICE_CODE,
		ROOM_NUM   = :NEW.ASSIGN_ROOM_NUM,
		BED_NUM   = :NEW.ASSIGN_BED_NUM,
		BED_CLASS_CODE  = :NEW.ASSIGN_BED_CLASS_CODE,
		BED_TYPE_CODE  = :NEW.ASSIGN_BED_TYPE_CODE,
		PAT_CURR_LOCN_TYPE = :NEW.PAT_CURR_LOCN_TYPE,
		PAT_CURR_LOCN_CODE = :NEW.PAT_CURR_LOCN_CODE,
		PAT_TRN_TIME  = :NEW.PAT_TRN_TIME,
		ADT_STATUS  = :NEW.ADT_STATUS,
		ADT_STATUS_SET_ON_DATE = :NEW.ADT_STATUS_SET_ON_DATE,
		ADT_STATUS_SET_BY_USER = :NEW.ADT_STATUS_SET_BY_USER,
		ADT_STATUS_SET_REASON = :NEW.ADT_STATUS_SET_REASON,
		OTH_ADT_STATUS  = :NEW.OTH_ADT_STATUS,
		IP_LEAVE_STATUS  = :NEW.IP_LEAVE_STATUS,
		LEAVE_EXPIRY_DATE_TIME = :NEW.LEAVE_EXPIRY_DATE_TIME,
		POL_REP_NO  = :NEW.POL_REP_NO,
		POL_STN_ID  = :NEW.POL_STN_ID,
		POL_ID   = :NEW.POL_ID,
		INFORMED_TO  = :NEW.INFORMED_TO,
		INFORMED_NAME  = :NEW.INFORMED_NAME,
		INFORMED_DATE_TIME = :NEW.INFORMED_DATE_TIME,
		MLC_YN   = :NEW.MLC_YN,
		OSCC_YN   = :NEW.OSCC_YN,
		MARKED_BY_ID  = :NEW.MARKED_BY_ID,
		MARKED_DATE  = :NEW.MARKED_DATE,
		CLOSED_BY_ID  = :NEW.CLOSED_BY_ID,
		CLOSED_DATE  = :NEW.CLOSED_DATE,
		APPT_CASE_YN  = :NEW.APPT_CASE_YN,
		APPT_ID   = :NEW.APPT_ID,
		DC_UNIT_CODE = :NEW.DC_UNIT_CODE,
		BED_ALLOCATION_DATE_TIME = :NEW.BED_ALLOCATION_DATE_TIME,
		MARK_ARRIVAL_DATE_TIME = :NEW.MARK_ARRIVAL_DATE_TIME,
		EXP_DISCHARGE_DATE_TIME = :NEW.EXP_DISCHARGE_DATE_TIME,
		MODIFIED_BY_ID = :NEW.MODIFIED_BY_ID,
		MODIFIED_DATE = :NEW.MODIFIED_DATE,
		MODIFIED_AT_WS_NO = :NEW.MODIFIED_AT_WS_NO,
		MODIFIED_FACILITY_ID = :NEW.MODIFIED_FACILITY_ID,
		ENC_MODIFIED_YN = NVL(:NEW.ENC_MODIFIED_YN,'N'),
		RESERVED_NURS_UNIT_CODE = :NEW.RESERVED_NURS_UNIT_CODE,
		RESERVED_ROOM_NO = :NEW.RESERVED_ROOM_NO,
		RESERVED_BED_NO = :NEW.RESERVED_BED_NO,
        ADMISSION_REMARKS = :NEW.ADMISSION_REMARKS,
        WEIGHT_ON_ADMISSION = :NEW.WEIGHT_ON_ADMISSION,
        WEIGHT_ON_ADMISSION_UNIT = :NEW.WEIGHT_ON_ADMISSION_UNIT,
        MOVEMENT_REASON_CODE = :NEW.MOVEMENT_REASON_CODE
		WHERE
		FACILITY_ID = :NEW.FACILITY_ID AND
		ENCOUNTER_ID = :NEW.ENCOUNTER_ID;
	ELSIF :NEW.ADT_STATUS = '08' THEN
		-- The following logic is to delete from IP_OPEN_ENCOUNTER table if the patient is discharged.
		BEGIN
		SELECT DIS_ACK_SRL_NO INTO P_DIS_ACK_SRL_NO FROM IP_OPEN_ENCOUNTER WHERE FACILITY_ID = :NEW.FACILITY_ID
		AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID;
		EXCEPTION WHEN NO_DATA_FOUND THEN
			P_DIS_ACK_SRL_NO := 0;
		END;
		DELETE FROM IP_OPEN_ENCOUNTER WHERE FACILITY_ID = :NEW.FACILITY_ID AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID;
		-- The following logic is to insert a record to IP_PATIENT_LAST_ENCOUNTER table if the patient is discharged.
		BEGIN
		SELECT COUNT(*) INTO P_ENC_COUNT FROM IP_PATIENT_LAST_ENCOUNTER WHERE FACILITY_ID = :NEW.FACILITY_ID
		AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID;
		END;
		IF P_ENC_COUNT = 0 THEN
			INSERT INTO IP_PATIENT_LAST_ENCOUNTER
			(FACILITY_ID, ENCOUNTER_ID, PATIENT_ID, ADMISSION_DATE_TIME, ADDED_BY_ID, ADDED_DATE,
			ADDED_AT_WS_NO, ADDED_FACILITY_ID, MODIFIED_BY_ID, MODIFIED_DATE, MODIFIED_AT_WS_NO,
			MODIFIED_FACILITY_ID, PATIENT_CLASS, PATIENT_TYPE, ADMISSION_TYPE, ADMISSION_TYPE_IND,
			NURSING_UNIT_CODE, ROOM_NUM, BED_NUM, BED_CLASS_CODE, BED_TYPE_CODE,
			SERVICE_CODE, SPECIALTY_CODE, SUBSERVICE_CODE, ADMIT_PRACTITIONER_ID, ATTEND_PRACTITIONER_ID,
			TEAM_ID, BED_ALLOCATION_DATE_TIME, DISCHARGE_DATE_TIME, DECEASED_DATE_TIME, REFERRAL_ID,
			APPT_CASE_YN, APPT_ID, BOOKING_CASE_YN, BOOKING_REF_NO, BACKDATED_YN, DC_UNIT_CODE,
			INFORMED_DATE_TIME, INFORMED_NAME, INFORMED_TO, MLC_YN, OSCC_YN, MARKED_BY_ID,
			MARKED_DATE, CLOSED_BY_ID, CLOSED_DATE, POL_ID, POL_REP_NO, POL_STN_ID,
			MARK_ARRIVAL_DATE_TIME, DISCHARGE_TYPE_CODE, DIS_ACK_SRL_NO)
			VALUES (
			:NEW.FACILITY_ID, :NEW.ENCOUNTER_ID, :NEW.PATIENT_ID, :NEW.VISIT_ADM_DATE_TIME, :NEW.ADDED_BY_ID, :NEW.ADDED_DATE,
			:NEW.ADDED_AT_WS_NO, :NEW.ADDED_FACILITY_ID, :NEW.MODIFIED_BY_ID, :NEW.MODIFIED_DATE, :NEW.MODIFIED_AT_WS_NO,
			:NEW.MODIFIED_FACILITY_ID, :NEW.PATIENT_CLASS, :NEW.PATIENT_TYPE, :NEW.VISIT_ADM_TYPE, :NEW.VISIT_ADM_TYPE_IND,
			:NEW.ASSIGN_CARE_LOCN_CODE, :NEW.ASSIGN_ROOM_NUM, :NEW.ASSIGN_BED_NUM, :NEW.ASSIGN_BED_CLASS_CODE, :NEW.ASSIGN_BED_TYPE_CODE,
			:NEW.SERVICE_CODE, :NEW.SPECIALTY_CODE, :NEW.SUBSERVICE_CODE, :NEW.ADMIT_PRACTITIONER_ID, :NEW.ATTEND_PRACTITIONER_ID,
			:NEW.TEAM_ID, :NEW.BED_ALLOCATION_DATE_TIME, :NEW.DISCHARGE_DATE_TIME, :NEW.DECEASED_DATE_TIME, :NEW.REFERRAL_ID,
			:NEW.APPT_CASE_YN, :NEW.APPT_ID, :NEW.BOOKING_CASE_YN, :NEW.BOOKING_REF_NO, :NEW.BACKDATED_YN, :NEW.DC_UNIT_CODE,
			:NEW.INFORMED_DATE_TIME, :NEW.INFORMED_NAME, :NEW.INFORMED_TO, :NEW.MLC_YN, :NEW.OSCC_YN, :NEW.MARKED_BY_ID,
			:NEW.MARKED_DATE, :NEW.CLOSED_BY_ID, :NEW.CLOSED_DATE, :NEW.POL_ID, :NEW.POL_REP_NO, :NEW.POL_STN_ID,
			:NEW.MARK_ARRIVAL_DATE_TIME, :NEW.DISPOSITION_TYPE, P_DIS_ACK_SRL_NO);
		END IF;
	END IF;
	IF :NEW.ADT_STATUS ='09' AND :OLD.ADT_STATUS IN ('00', '01') THEN
		--The following logic is to delete from IP_OPEN_ENCOUNTER table if the patient's Admission is Canclled.
		BEGIN
		SELECT DIS_ACK_SRL_NO INTO P_DIS_ACK_SRL_NO FROM IP_OPEN_ENCOUNTER WHERE FACILITY_ID = :NEW.FACILITY_ID
		AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID;
		EXCEPTION WHEN NO_DATA_FOUND THEN
		P_DIS_ACK_SRL_NO := 0;
		END;
		DELETE FROM IP_OPEN_ENCOUNTER WHERE FACILITY_ID = :NEW.FACILITY_ID AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID;
	END IF;
	IF :NEW.ADT_STATUS ='01' AND :OLD.ADT_STATUS = '08' THEN
		/* The below logic is inserting into ip_open_encounter table whenever revert back the discharged patient */
		BEGIN
			SELECT SEX INTO V_SEX_IND FROM MP_PATIENT WHERE PATIENT_ID = :OLD.PATIENT_ID;
			SELECT MAX(SRL_NO) INTO V_MAX_SRL_NO FROM IP_ADT_TRN WHERE
			FACILITY_ID = :OLD.FACILITY_ID AND ENCOUNTER_ID = :OLD.ENCOUNTER_ID;
			SELECT TRANSFER_TYPE_CODE
			INTO V_TRN_CODE
			FROM IP_TRANSFER_TYPE
			WHERE EFF_STATUS='E' AND ROWNUM < 2;
		EXCEPTION
			WHEN OTHERS THEN NULL;
		END;
	/*The below logic is added for the incident IN038484 - To auto link the baby bed to the mother bed -- START*/
	BEGIN
		SELECT BABY_PATIENT_ID, BABY_BED_NO,(LENGTH (BABY_bed_no) - LENGTH (REPLACE (baby_bed_no, '|', NULL))),(LENGTH (BABY_PATIENT_ID) - LENGTH (REPLACE (BABY_PATIENT_ID, '|', NULL))) INTO  V_BABY_PATIENT_ID, V_BABY_BED_NO,V_BED_LEN, V_PATID_LEN FROM IP_DISCHARGE_ADVICE WHERE FACILITY_ID=:NEW.FACILITY_ID AND ENCOUNTER_ID=:NEW.ENCOUNTER_ID and dis_adv_srl_no = ( select max(dis_Adv_Srl_No) from IP_DISCHARGE_ADVICE where facility_id =:NEW.FACILITY_ID and encounter_id = :NEW.ENCOUNTER_ID ) ;
	EXCEPTION
		WHEN OTHERS THEN NULL;
	END;
	/*The above logic is added for the incident IN038484 - To auto link the baby bed to the mother bed -- END*/
		BEGIN
			INSERT INTO IP_OPEN_ENCOUNTER
			(FACILITY_ID, ENCOUNTER_ID, PATIENT_ID,
			ADMISSION_DATE_TIME, ADDED_BY_ID, ADDED_DATE,
			ADDED_AT_WS_NO, ADDED_FACILITY_ID,
			MODIFIED_BY_ID, MODIFIED_DATE, MODIFIED_AT_WS_NO,
			MODIFIED_FACILITY_ID, ADMISSION_TYPE,
			ADMISSION_TYPE_IND, APPT_CASE_YN, BACKDATED_YN,
			BOOKING_CASE_YN, MLC_YN, NURSING_UNIT_CODE,
			OSCC_YN, PATIENT_CLASS, ADMIT_PRACTITIONER_ID,
			ADT_STATUS, ADT_STATUS_SET_BY_USER,
			ADT_STATUS_SET_ON_DATE, ADT_STATUS_SET_REASON,
			APPT_ID, ATTEND_PRACTITIONER_ID,
			BED_ALLOCATION_DATE_TIME, BED_NUM,
			BOOKING_REF_NO, CHIEF_COMPLAINT, CLOSED_BY_ID,
			CLOSED_DATE, DC_UNIT_CODE, INFORMED_DATE_TIME,
			INFORMED_NAME, INFORMED_TO, IP_LEAVE_STATUS,
			LEAVE_EXPIRY_DATE_TIME, MARKED_BY_ID,
			MARKED_DATE, OTH_ADT_STATUS, PAT_CURR_LOCN_CODE,
			PAT_CURR_LOCN_TYPE, PAT_TRN_TIME, POL_ID,
			POL_REP_NO, POL_STN_ID, REFERRAL_ID,
			ROOM_NUM, SERVICE_CODE, SPECIALTY_CODE,
			SUBSERVICE_CODE, TEAM_ID, MARK_ARRIVAL_DATE_TIME, BED_CLASS_CODE, BED_TYPE_CODE,
			CANCEL_REASON_CODE, CANCEL_DISCH_PRACTITIONER_ID, CANCEL_DISCH_DATE, ADMISSION_REMARKS,
            EXP_DISCHARGE_DATE_TIME,WEIGHT_ON_ADMISSION,WEIGHT_ON_ADMISSION_UNIT
			)
			VALUES (:NEW.FACILITY_ID, :OLD.ENCOUNTER_ID, :OLD.PATIENT_ID,
			:NEW.VISIT_ADM_DATE_TIME, :NEW.ADDED_BY_ID, SYSDATE,
			:NEW.ADDED_AT_WS_NO, :NEW.ADDED_FACILITY_ID,
			:NEW.MODIFIED_BY_ID, SYSDATE, :NEW.MODIFIED_AT_WS_NO,
			:NEW.MODIFIED_FACILITY_ID, :NEW.VISIT_ADM_TYPE,
			:NEW.VISIT_ADM_TYPE_IND, :NEW.APPT_CASE_YN, :NEW.BACKDATED_YN,
			:NEW.BOOKING_CASE_YN, :NEW.MLC_YN, :NEW.ASSIGN_CARE_LOCN_CODE,
			:NEW.OSCC_YN, :NEW.PATIENT_CLASS, :NEW.ADMIT_PRACTITIONER_ID,
			:NEW.ADT_STATUS, :NEW.ADT_STATUS_SET_BY_USER,
			:NEW.ADT_STATUS_SET_ON_DATE, :NEW.ADT_STATUS_SET_REASON,
			:NEW.APPT_ID, :NEW.ATTEND_PRACTITIONER_ID,
			:NEW.BED_ALLOCATION_DATE_TIME, :NEW.ASSIGN_BED_NUM,
			:NEW.BOOKING_REF_NO, :NEW.CHIEF_COMPLAINT, :NEW.CLOSED_BY_ID,
			:NEW.CLOSED_DATE, :NEW.DC_UNIT_CODE, :NEW.INFORMED_DATE_TIME,
			:NEW.INFORMED_NAME, :NEW.INFORMED_TO, :NEW.IP_LEAVE_STATUS,
			:NEW.LEAVE_EXPIRY_DATE_TIME, :NEW.MARKED_BY_ID,
			:NEW.MARKED_DATE, :NEW.OTH_ADT_STATUS, :NEW.PAT_CURR_LOCN_CODE,
			:NEW.PAT_CURR_LOCN_TYPE, :NEW.PAT_TRN_TIME, :NEW.POL_ID,
			:NEW.POL_REP_NO, :NEW.POL_STN_ID, :NEW.REFERRAL_ID,
			:NEW.ASSIGN_ROOM_NUM, :NEW.SERVICE_CODE, :NEW.SPECIALTY_CODE,
			:NEW.SUBSERVICE_CODE, :NEW.TEAM_ID, :NEW.MARK_ARRIVAL_DATE_TIME,
			:NEW.ASSIGN_BED_CLASS_CODE,:NEW.ASSIGN_BED_TYPE_CODE,
			:NEW.CANCEL_REASON_CODE,:NEW.CANCEL_DISCH_PRACTITIONER_ID,:NEW.CANCEL_DISCH_DATE, :NEW.ADMISSION_REMARKS,
            :NEW.EXP_DISCHARGE_DATE_TIME,:NEW.WEIGHT_ON_ADMISSION,:NEW.WEIGHT_ON_ADMISSION_UNIT
			);
			/* Deleting discharged patient record from ip_patient_last_encounter */
			DELETE FROM IP_PATIENT_LAST_ENCOUNTER
			WHERE FACILITY_ID = :OLD.FACILITY_ID AND ENCOUNTER_ID = :OLD.ENCOUNTER_ID;
			/* Inserting into Cancelled Discharge Table for Audit Trail*/
			SELECT NVL(MAX(SRL_NO),0) + 1 INTO V_MAX_SRL_NO_CAN_DIS
			FROM IP_CANCELLED_DISCHARGE
			WHERE FACILITY_ID = :NEW.FACILITY_ID AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID;
			INSERT INTO IP_CANCELLED_DISCHARGE
			(
			FACILITY_ID, ENCOUNTER_ID, SRL_NO, PATIENT_ID, PATIENT_CLASS, ADMISSION_DATE_TIME, TRN_TYPE,
			TRN_CODE, TRN_DATE_TIME, FR_NURSING_UNIT_CODE, FR_SERVICE_CODE, FR_ROOM_NO, FR_BED_NO,
			FR_BED_CLASS_CODE, FR_BED_TYPE_CODE, FR_PRACTITIONER_ID, FR_SPECIALTY_CODE,
			FR_BED_TYPE_CODE_BY_DEFN, FR_SUBSERVICE_CODE, FROM_PRACT_TEAM_ID, EXPECTED_DISCHARGE_DATE,
			DECEASED_DATE_TIME, AUTH_PRACTITIONER_ID, ADT_TRN_STATUS, DISCH_PRACTITIONER_ID,
			DISCHARGE_DATE_TIME, CANCEL_REASON_CODE, CANCEL_DISCH_PRACTITIONER_ID, CANCEL_DISCH_DATE,
			ADDED_BY_ID, ADDED_DATE, ADDED_AT_WS_NO, ADDED_FACILITY_ID, MODIFIED_BY_ID,
			MODIFIED_DATE, MODIFIED_AT_WS_NO, MODIFIED_FACILITY_ID
			)
			SELECT
			FACILITY_ID, ENCOUNTER_ID, V_MAX_SRL_NO_CAN_DIS, PATIENT_ID, PATIENT_CLASS, ADMISSION_DATE_TIME, TRN_TYPE,
			TRN_CODE, TRN_DATE_TIME, FR_NURSING_UNIT_CODE, FR_SERVICE_CODE, FR_ROOM_NO, FR_BED_NO,
			FR_BED_CLASS_CODE, FR_BED_TYPE_CODE, FR_PRACTITIONER_ID, FR_SPECIALTY_CODE,
			FR_BED_TYPE_CODE_BY_DEFN, FR_SUBSERVICE_CODE, FROM_PRACT_TEAM_ID, EXPECTED_DISCHARGE_DATE,
			DECEASED_DATE_TIME, AUTH_PRACTITIONER_ID, ADT_TRN_STATUS, DISCH_PRACTITIONER_ID,
			DISCHARGE_DATE_TIME, :NEW.CANCEL_REASON_CODE, :NEW.CANCEL_DISCH_PRACTITIONER_ID, :NEW.CANCEL_DISCH_DATE,
			ADDED_BY_ID, ADDED_DATE, ADDED_AT_WS_NO, ADDED_FACILITY_ID, MODIFIED_BY_ID,
			MODIFIED_DATE, MODIFIED_AT_WS_NO, MODIFIED_FACILITY_ID
			FROM IP_ADT_TRN WHERE FACILITY_ID = :NEW.FACILITY_ID AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID
			AND TRN_TYPE = 'D';
			/* Deleting Data from IP_ADT_TRN */
			DELETE FROM IP_ADT_TRN WHERE FACILITY_ID = :NEW.FACILITY_ID
			AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID
			AND TRN_TYPE = 'D';
			/* Updating TRN_TO_DATE_TIME for the previous record in IP_ADT_TRN */
			UPDATE IP_ADT_TRN SET TRN_TO_DATE_TIME = NULL,
			MODIFIED_BY_ID = :NEW.MODIFIED_BY_ID,
			MODIFIED_DATE = :NEW.MODIFIED_DATE,
			MODIFIED_AT_WS_NO = :NEW.MODIFIED_AT_WS_NO,
			MODIFIED_FACILITY_ID = :NEW.MODIFIED_FACILITY_ID
			WHERE FACILITY_ID = :NEW.FACILITY_ID
			AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID
			AND SRL_NO = V_MAX_SRL_NO-1;
			UPDATE IP_ADT_TRN SET DISCHARGE_DATE_TIME = NULL,
			MODIFIED_BY_ID = :NEW.MODIFIED_BY_ID,
			MODIFIED_DATE = :NEW.MODIFIED_DATE,
			MODIFIED_AT_WS_NO = :NEW.MODIFIED_AT_WS_NO,
			MODIFIED_FACILITY_ID = :NEW.MODIFIED_FACILITY_ID
			WHERE FACILITY_ID = :NEW.FACILITY_ID
			AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID;
			/* UPDATING IP_DISCHARGE_ADVICE */
			UPDATE IP_DISCHARGE_ADVICE
			SET DIS_ADV_STATUS ='0',
			MODIFIED_BY_ID = :NEW.MODIFIED_BY_ID,
			MODIFIED_DATE = :NEW.MODIFIED_DATE,
			MODIFIED_AT_WS_NO = :NEW.MODIFIED_AT_WS_NO,
			MODIFIED_FACILITY_ID = :NEW.MODIFIED_FACILITY_ID
			WHERE FACILITY_ID = :OLD.FACILITY_ID
			AND ENCOUNTER_ID = :OLD.ENCOUNTER_ID
			AND DIS_ADV_STATUS ='1';
			/* UPDATING IP_BED_BOOKING */
			UPDATE IP_BED_BOOKING SET BOOKING_STATUS = '9',
			MODIFIED_BY_ID = :NEW.MODIFIED_BY_ID,
			MODIFIED_DATE = :NEW.MODIFIED_DATE,
			MODIFIED_AT_WS_NO = :NEW.MODIFIED_AT_WS_NO,
			MODIFIED_FACILITY_ID = :NEW.MODIFIED_FACILITY_ID
			WHERE BOOKING_TYPE = 'D'
			AND FACILITY_ID = :OLD.FACILITY_ID
			AND REQ_NURSING_UNIT_CODE = :NEW.ASSIGN_CARE_LOCN_CODE
			AND REQ_BED_NO = :NEW.ASSIGN_BED_NUM;
			/* DELETE FROM PR_SICK_LEAVE_REGISTER  */
			DELETE FROM PR_SICK_LEAVE_REGISTER
			WHERE FACILITY_ID = :OLD.FACILITY_ID
			AND ENCOUNTER_ID = :OLD.ENCOUNTER_ID;
			/* UPDATING IP_NURSING_UNIT */
			UPDATE IP_NURSING_UNIT
			SET NUM_OF_BEDS_OCCUPIED = NUM_OF_BEDS_OCCUPIED + 1,
			MODIFIED_BY_ID = :NEW.MODIFIED_BY_ID,
			MODIFIED_DATE = :NEW.MODIFIED_DATE,
			MODIFIED_AT_WS_NO = :NEW.MODIFIED_AT_WS_NO,
			MODIFIED_FACILITY_ID = :NEW.MODIFIED_FACILITY_ID
			WHERE FACILITY_ID = :OLD.FACILITY_ID
			AND NURSING_UNIT_CODE = :NEW.ASSIGN_CARE_LOCN_CODE;
			/* Updating Nursing Unit Bed with Occupied Status for the New Bed */
			UPDATE IP_NURSING_UNIT_BED
			SET OCCUPYING_PATIENT_ID = :OLD.PATIENT_ID,
			CURRENT_STATUS = 'O',
			OCCUPIED_UNTIL_DATE_TIME = SYSDATE,
			MODIFIED_BY_ID = :NEW.MODIFIED_BY_ID,
			MODIFIED_DATE = :NEW.MODIFIED_DATE,
			MODIFIED_AT_WS_NO = :NEW.MODIFIED_AT_WS_NO,
			MODIFIED_FACILITY_ID = :NEW.MODIFIED_FACILITY_ID
			WHERE FACILITY_ID = :NEW.FACILITY_ID
			AND NURSING_UNIT_CODE = :NEW.ASSIGN_CARE_LOCN_CODE
			AND BED_NO = :NEW.ASSIGN_BED_NUM;
	    /*Updating ip_nursing_unit_bed for auto linking the baby bed for the incident - IN038484*/
		IF V_BED_LEN IS NOT NULL AND V_BED_LEN > 0THEN
	    FOR i in 1..V_BED_LEN loop
	    BEGIN
	    SELECT REPLACE(REGEXP_SUBSTR(BABY_BED_NO,'[^|]*[|$]',1,i),'|',''),
	    REPLACE(REGEXP_SUBSTR(BABY_PATIENT_ID,'[^|]*[|$]',1,i),'|',''),
            NVL(LENGTH( REPLACE(REGEXP_SUBSTR(BABY_BED_NO,'[^|]*[|$]',1,i),'|','')),0),
            NVL(LENGTH( REPLACE(REGEXP_SUBSTR(BABY_BED_NO,'[^|]*[|$]',1,i),'|','')),0)
            INTO OCC_BABY_BED,OCC_PATID,BED_LENGTH,PAT_LENGTH
            FROM IP_DISCHARGE_ADVICE WHERE PATIENT_ID = :NEW.PATIENT_ID AND ENCOUNTER_ID=:NEW.ENCOUNTER_ID AND FACILITY_ID=:NEW.FACILITY_ID and dis_adv_srl_no = ( select max(dis_Adv_Srl_No) from IP_DISCHARGE_ADVICE where facility_id =:NEW.FACILITY_ID and encounter_id = :NEW.ENCOUNTER_ID )  ;
	    END;
	    BEGIN
	    IF BED_LENGTH > 0 AND PAT_LENGTH>0 THEN
	    UPDATE IP_NURSING_UNIT_BED SET
	    MOTHERS_PATIENT_ID=:OLD.PATIENT_ID,
	    MOTHERS_ENCOUNTER_ID=:OLD.ENCOUNTER_ID,
	    CURRENT_STATUS='O',
	    OCCUPYING_PATIENT_ID = OCC_PATID,
	    MODIFIED_DATE=sysdate,
	    MODIFIED_FACILITY_ID=:NEW.MODIFIED_FACILITY_ID,
	    MODIFIED_BY_ID=:NEW.MODIFIED_BY_ID,
	    MODIFIED_AT_WS_NO=:NEW.MODIFIED_AT_WS_NO
            WHERE FACILITY_ID=:NEW.FACILITY_ID
	    AND NURSING_UNIT_CODE =:NEW.ASSIGN_CARE_LOCN_CODE
	    AND MAIN_BED_NO=:NEW.ASSIGN_BED_NUM
	    AND BED_NO=OCC_BABY_BED;

	    END IF;
	    END;
	    END LOOP;
		END IF;
			/* Updating Nursing Unit Room with Statistics Count for the New Room  */
			IF V_SEX_IND ='M' THEN
				UPDATE IP_NURSING_UNIT_ROOM
				SET OCC_MALE_BED_COUNT = OCC_MALE_BED_COUNT + 1,
				MODIFIED_BY_ID = :NEW.MODIFIED_BY_ID,
				MODIFIED_DATE = :NEW.MODIFIED_DATE,
				MODIFIED_AT_WS_NO = :NEW.MODIFIED_AT_WS_NO,
				MODIFIED_FACILITY_ID = :NEW.MODIFIED_FACILITY_ID
				WHERE FACILITY_ID = :NEW.FACILITY_ID
				AND ROOM_NO = :NEW.ASSIGN_ROOM_NUM
				AND NURSING_UNIT_CODE = :NEW.ASSIGN_CARE_LOCN_CODE;
			ELSIF V_SEX_IND ='F' THEN
				UPDATE IP_NURSING_UNIT_ROOM
				SET OCC_FEMALE_BED_COUNT = OCC_FEMALE_BED_COUNT + 1,
				MODIFIED_BY_ID = :NEW.MODIFIED_BY_ID,
				MODIFIED_DATE = :NEW.MODIFIED_DATE,
				MODIFIED_AT_WS_NO = :NEW.MODIFIED_AT_WS_NO,
				MODIFIED_FACILITY_ID = :NEW.MODIFIED_FACILITY_ID
				WHERE FACILITY_ID = :NEW.FACILITY_ID
				AND ROOM_NO = :NEW.ASSIGN_ROOM_NUM
				AND NURSING_UNIT_CODE = :NEW.ASSIGN_CARE_LOCN_CODE;
			ELSE
				UPDATE IP_NURSING_UNIT_ROOM
				SET OCC_UNKNOWN_BED_COUNT = OCC_UNKNOWN_BED_COUNT + 1,
				MODIFIED_BY_ID = :NEW.MODIFIED_BY_ID,
				MODIFIED_DATE = :NEW.MODIFIED_DATE,
				MODIFIED_AT_WS_NO = :NEW.MODIFIED_AT_WS_NO,
				MODIFIED_FACILITY_ID = :NEW.MODIFIED_FACILITY_ID
				WHERE FACILITY_ID = :NEW.FACILITY_ID
				AND ROOM_NO = :NEW.ASSIGN_ROOM_NUM
				AND NURSING_UNIT_CODE = :NEW.ASSIGN_CARE_LOCN_CODE;
			END IF;
		END;
		/* UPDATING IP_NURSING_UNIT_BED */
		IF :NEW.ASSIGN_BED_NUM != :OLD.ASSIGN_BED_NUM THEN
			/* Inserting a Intra-Ward Transfer into IP_ADT_TRN if bed number is changed  */
			SELECT DEPT_CODE INTO V_DEPT_CODE FROM IP_NURSING_UNIT WHERE
			FACILITY_ID=:NEW.FACILITY_ID AND NURSING_UNIT_CODE=:NEW.ASSIGN_CARE_LOCN_CODE;
			INSERT INTO IP_ADT_TRN
			(FACILITY_ID, ENCOUNTER_ID, SRL_NO,ADMISSION_DATE_TIME,
			PATIENT_ID, TRN_TYPE, TRN_CODE, TRN_DATE_TIME,PATIENT_CLASS,
			FR_NURSING_UNIT_CODE, FR_SERVICE_CODE, FR_SUBSERVICE_CODE, FR_ROOM_NO,
			FR_BED_NO, FR_BED_CLASS_CODE, FR_BED_TYPE_CODE,
			FR_PRACTITIONER_ID, FR_SPECIALTY_CODE, EMERGENCY_TRN_YN,
			TO_NURSING_UNIT, TO_SERVICE_CODE,
			TO_ROOM_NO, TO_BED_NO, TO_BED_CLASS_CODE,
			TO_BED_TYPE_CODE, TO_PRACTITIONER_ID,
			TO_SPECIALTY_CODE, ADDED_BY_ID, ADDED_DATE,
			ADDED_AT_WS_NO, ADDED_FACILITY_ID,
			MODIFIED_BY_ID, MODIFIED_DATE, MODIFIED_AT_WS_NO,
			MODIFIED_FACILITY_ID, ADT_TRN_STATUS, TFR_TYPE, ORIG_DEPT_CODE
			)
			VALUES (:OLD.FACILITY_ID, :OLD.ENCOUNTER_ID, V_MAX_SRL_NO, :NEW.VISIT_ADM_DATE_TIME,
			:OLD.PATIENT_ID, 'T', V_TRN_CODE, SYSDATE, :NEW.PATIENT_CLASS,
			:NEW.ASSIGN_CARE_LOCN_CODE, :NEW.SERVICE_CODE, :NEW.SUBSERVICE_CODE, :OLD.ASSIGN_ROOM_NUM,
			:OLD.ASSIGN_BED_NUM, :OLD.ASSIGN_BED_CLASS_CODE, :OLD.ASSIGN_BED_TYPE_CODE,
			:OLD.ATTEND_PRACTITIONER_ID, :OLD.SPECIALTY_CODE, 'Y',
			:NEW.ASSIGN_CARE_LOCN_CODE, :NEW.SERVICE_CODE,
			:NEW.ASSIGN_ROOM_NUM, :NEW.ASSIGN_BED_NUM, :NEW.ASSIGN_BED_CLASS_CODE,
			:NEW.ASSIGN_BED_TYPE_CODE, :NEW.ATTEND_PRACTITIONER_ID,
			:NEW.SPECIALTY_CODE, :NEW.ADDED_BY_ID, :NEW.ADDED_DATE,
			:NEW.ADDED_AT_WS_NO, :NEW.ADDED_FACILITY_ID,
			:NEW.MODIFIED_BY_ID, :NEW.MODIFIED_DATE, :NEW.MODIFIED_AT_WS_NO,
			:NEW.MODIFIED_FACILITY_ID, '0', 'D', V_DEPT_CODE
			);
			/* Updating TRN_TO_DATE_TIME for the previous record in IP_ADT_TRN */
			UPDATE IP_ADT_TRN SET TRN_TO_DATE_TIME = SYSDATE,
			MODIFIED_BY_ID = :NEW.MODIFIED_BY_ID,
			MODIFIED_DATE = :NEW.MODIFIED_DATE,
			MODIFIED_AT_WS_NO = :NEW.MODIFIED_AT_WS_NO,
			MODIFIED_FACILITY_ID = :NEW.MODIFIED_FACILITY_ID
			WHERE FACILITY_ID = :NEW.FACILITY_ID
			AND ENCOUNTER_ID = :NEW.ENCOUNTER_ID
			AND SRL_NO = V_MAX_SRL_NO-1;
		END IF;
	END IF;
END IP_PR_ENCNTR_UPD_OPEN_ENC_TRG;


/
ALTER TRIGGER "IBAEHIS"."IP_PR_ENCNTR_UPD_OPEN_ENC_TRG" ENABLE;
--------------------------------------------------------
--  DDL for Trigger XH_AFUP_PR_ENCOUNTER_X03
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "IBAEHIS"."XH_AFUP_PR_ENCOUNTER_X03" 
AFTER UPDATE ON PR_ENCOUNTER FOR EACH ROW
 WHEN (
		NEW.PATIENT_ID = NVL(OLD.PATIENT_ID,NEW.PATIENT_ID)
		AND NVL(OLD.ATTEND_PRACTITIONER_ID,'XX')  <> NEW.ATTEND_PRACTITIONER_ID
      ) DECLARE

    v_interface_yn			XH_PARAM.INTERFACE_YN%TYPE;
    v_filter_yn				VARCHAR2(1);
    v_fac_int_yn			VARCHAR2(3);
    v_action_type			XH_EVENT.ACTION_TYPE%TYPE;
    v_event_interfaced_yn   VARCHAR2(3);

    v_accession_num         XH_EVENT.ACCESSION_NUM%TYPE;
    v_message_type			VARCHAR2(10);

    v_app_err_key			SM_PROC_MSG.APP_KEY%TYPE;
    v_ora_err_msg			SM_PROC_MSG.ERR_MSG%TYPE;
    v_app_err_msg           SM_PROC_MSG.APP_MSG%TYPE;
    v_proc					SM_PROC_MSG.PROC_ID%TYPE := 'XH_AFUP_PR_ENCOUNTER_X03' ;
    v_failed_proc			SM_PROC_MSG.FAILED_PROC_ID%TYPE := 'XH_AFUP_PR_ENCOUNTER_X03' ;
    l_trans_status			VARCHAR2(1);
    l_out_errmsg			VARCHAR2(4000);

	l_myhix_id              MP_PATIENT.MYHIX_ID%TYPE;
	l_from_date				VARCHAR2(20);
	l_to_date				VARCHAR2(20);
	l_date_period			NUMBER := 12;
	l_out_xml_data			CLOB;
	l_out_errcd				VARCHAR2(50);

	l_ds_count				NUMBER := 0;
	l_rs_count				NUMBER := 0;
	l_err_code				varchar2(1) := 'S';

	l_record_count				NUMBER := 0;


BEGIN

    XHTRACING.G_PROG_ID:='XH_AFUP_PR_ENCOUNTER_X03';
    XHTRACING.G_FLAG:=XHTRACING.ENABLE_OR_DISABLE_TRACING;

    v_app_err_key := 'Encounter Id :'||    :NEW.Encounter_id||chr(10)||
            'Patient Id :'||:NEW.patient_id||chr(10)||
            'Facility Id :'||:NEW.facility_id ||chr(10)||
            'Practitioner Id :'||:NEW.ATTEND_PRACTITIONER_ID;
    xhtracing.traces(v_proc,v_app_err_key,'T');

    v_app_err_msg := 'Checking Interface/Filter Enabled or not...';
    xhtracing.traces(v_proc,v_app_err_msg,'T');

    xhcore.get_interface_parameters (v_interface_yn,v_filter_yn);
    xhtracing.traces(v_proc,'v_interface_yn - '||v_interface_yn||chr(10)||'v_filter_yn - '||v_filter_yn,'T');

    v_app_err_msg := 'Checking Interface Enabled for Facility or not...';
    xhtracing.traces(v_proc,v_app_err_msg,'T');

    xhcore.get_facility_parameters  (:NEW.facility_id,v_fac_int_yn);
    xhtracing.traces(v_proc,'v_fac_int_yn - '|| v_fac_int_yn,'T');

    IF UPPER (v_interface_yn) = 'Y' AND v_fac_int_yn = 'Y' THEN

        v_app_err_msg:='Checking X03 Event is enabled or not...';
        xhtracing.traces(v_proc,v_app_err_msg,'T');

        xhcore.get_event_message_details('X03',v_message_type, v_event_interfaced_yn);
        xhtracing.traces(v_proc,'X03 v_event_interfaced_yn - '||v_event_interfaced_yn,'T');

        IF v_event_interfaced_yn = 'Y' THEN

			BEGIN

				v_app_err_msg:='Checking date period...';
				xhtracing.traces(v_proc,v_app_err_msg,'T');

				SELECT	default_value INTO	l_date_period FROM	xh_standard_control_seg
					WHERE	standard_code = 'XMLSTD' AND	segment_id = 'DISREGC' AND	element_id = 'DATE_PERIOD';

			EXCEPTION
				WHEN NO_DATA_FOUND THEN
					l_date_period := 12;

				WHEN OTHERS THEN
					v_ora_err_msg := 'Error while fetching DATE_PERIOD - '|| SQLCODE || '-' || SUBSTR (SQLERRM, 1, 3900);
					xhgenprc.register_error (:NEW.modified_facility_id,v_proc,'XHBASE.XH_EVENT_QUEUE_INS',v_app_err_msg,v_ora_err_msg,v_app_err_key);
					xhtracing.traces (v_proc, 'Exception while fetching DATE_PERIOD - ' || SQLERRM, 'T');
			END;

			v_app_err_msg:='Date Period configured ...'||l_date_period;
			xhtracing.traces(v_proc,v_app_err_msg,'T');

			BEGIN

				v_app_err_msg:='Checking MyHix ID...';
				xhtracing.traces(v_proc,v_app_err_msg,'T');

				select to_char(trunc(add_months(sysdate,-l_date_period)),'yyyymmddhh24miss') from_date, to_char(TRUNC(SYSDATE) + 86399 / 86400,'yyyymmddhh24miss')  end_date, nvl(MYHIX_ID,'') MYHIX_ID
						into  l_from_date, l_to_date, l_myhix_id from MP_PATIENT
					WHERE PATIENT_ID = :NEW.PATIENT_ID;

			EXCEPTION
				WHEN OTHERS THEN
					l_err_code := 'E';
					v_ora_err_msg := 'Error while fetching MYHIX ID - '|| SQLCODE || '-' || SUBSTR (SQLERRM, 1, 3900);
					xhgenprc.register_error (:NEW.modified_facility_id,v_proc,'XHBASE.XH_EVENT_QUEUE_INS',v_app_err_msg,v_ora_err_msg,v_app_err_key);
					xhtracing.traces (v_proc, 'Exception while fetching MYHIX ID - ' || SQLERRM, 'T');
			END;

